List.where((i) => i < 4).toList(); // b = [1, 2, 3] var sList = ['one', 'two', 'three', 'four']; var c = sList.where((i) => i.length > 3).toList(); // c = ['three', 'four']\",\"whereType<T>() ‚Üí Iterable<T> :\",\"Extrait un it√©rable qui ne contient que les √©l√©ments du m√™me type depuis la liste\",\"Il faut reconvertir en liste apr√®s\",\"Ex :\",\"var mixList = [1, \\\"a\\\", 2, \\\"b\\\", 3, \\\"c\\\", 4, \\\"d\\\"]; var num = mixList.whereType\\\\<int>().toList(); // [1, 2, 3, 4]\",\"Ensemble (Set)\",\"Ensemble de donn√©es de m√™me type sans doublons\",\"Ex :\",\"var halogens = {'fluorine', 'chlorine', 'bromine', 'iodine', 'astatine'}; // Dart inf√®re le type String var elements = <String>{}; // Cr√©ation d'un ensemble vide var elements = {} // ! Cr√©e un dictionnaire et non un ensemble elements.add('fluorine'); // On ajoute 'fluorine' elements.addAll(halogens); // On ajoute tous les √©l√©ments de halogens, sauf 'fluorine' qui est d√©j√† dedans\",\"Les ensembles supportent aussi les ... et ...? et les compr√©hension de liste\",\"les ensembles ont les m√™mes m√©thodes que les listes (avec d'autres)\",\"Les ensembles ne servent quasiment √† rien, juste √† virer les doublons\",\"Ex :\",\"var lst = [1, 1, 3, 4, 1, 2, 3, 5]; // On d√©compose la liste et on en cr√©e un ensemble que l'on d√©compose pour recr√©e une liste var lst2 = [...{...lst}]; // lst2 = [1, 3, 4, 2, 5]\",\"Dictionnaire (Map)\",\"Association entre une cl√© et une valeur\",\"Ex :\",\"var gifts = { // Cl√©: Valeur 'first': 'partridge', 'second': 'turtledoves', 'fifth': 'golden rings' }; // Dart inf√®re le type Map\\\\<String, String> var nobleGases = { 2: 'helium', 10: 'neon', 18: 'argon', }; // Ici, Map\\\\<int, String> // On peut cr√©e un dictionnaire vide var gifts = Map\\\\<String, String>(); // Ou var gifts = {} // Dart inf√®rera le type avec le premier ajout de donn√©e // Et y ajouter les valeurs apr√®s gifts['first'] = 'partridge';\",\"Les dictionnaires supportent aussi les ... et ...? et les compr√©hension de liste\",\"Fonction de base\",\"entries ‚Üí Iterable<MapEntry<K, V>> :\",\"Read-Only\",\"Retourne les valeurs du dictionnaire\",\"Il faut reconvertir en liste apr√®s\",\"Ex :\",\"var dct = {'a': 1, 'b': 2, 'c': 3}; var valeurs = dct.entries; // valeurs = [MapEntry<String, int>('a', 1), MapEntry<String, int>('b', 2), MapEntry<String, int>('c', 3)]\",\"isEmpty ‚Üí bool :\",\"Read-Only\",\"V√©rifie que le dictionnaire est vide\",\"Ex :\",\"var dct = {'a': 1, 'b': 2, 'c': 3}; var b = dct.isEmpty; // b = False\",\"isNotEmpty ‚Üí bool :\",\"Read-Only\",\"V√©rifie que le dictionnaire est vide\",\"Ex :\",\"var dct = {'a': 1, 'b': 2, 'c': 3}; var b = dct.isNotEmpty; // b = True\",\"keys ‚Üí Iterable<K> :\",\"Read-Only\",\"Retourne l'it√©rable des cl√©s du dictionnaire\",\"Il faut reconvertir en liste apr√®s\",\"Ex :\",\"var dct = {'a': 1, 'b': 2, 'c': 3}; var b = dct.keys.toList(); // b = ['a', 'b', 'c']\",\"length ‚Üí int :\",\"Read-Only\",\"Retourne la longeur du dictionnaire (le nombre de cl√©s)\",\"Ex :\",\"var dct = {'a': 1, 'b': 2, 'c': 3}; var b = dct.length; // b = 3\",\"values ‚Üí Iterable<V> :\",\"Read-Only\",\"Retourne l'it√©rable des valeurs du dictionnaire\",\"Il faut reconvertir en liste apr√®s\",\"Ex :\",\"var dct = {'a': 1, 'b': 2, 'c': 3}; var b = dct.values.toList(); // b = [1, 2, 3]\",\"addAll(Map<K, V> other) ‚Üí void :\",\"Ajoute le dictionnaire donn√©\",\"Si une cl√© est d√©j√† dans le dictionnaire, sa valeur est remplac√©e par la nouvelle\",\"Ex :\",\"var planets = <int, String>{1: 'Mercury', 2: 'Earth'}; planets.addAll({5: 'Jupiter', 6: 'Saturn'}); // planets = {1: 'Mercury', 2: 'Earth', 5: 'Jupiter', 6: 'Saturn'}\",\"clear() ‚Üí void :\",\"Supprime tout le contenu du dictionnaire\",\"Ex :\",\"var planets = <int, String>{1: 'Mercury', 2: 'Earth'}; planets.clear(); // planets = {}\",\"containsKey(Object? key) ‚Üí bool :\",\"V√©rifie que la cl√© donn√©e est parmi les cl√©s du dictionnaire\",\"Ex :\",\"var planets = <int, String>{1: 'Mercury', 2: 'Earth'}; var isIn = planets.containsKey(1); // isIn = True\",\"containsValue(Object? value) ‚Üí bool :\",\"V√©rifie que la valeur donn√©e est parmis les cl√©s du dictionnaire\",\"Ex :\",\"var planets = <int, String>{1: 'Mercury', 2: 'Earth'}; var isIn = planets.containsValue('Earth'); // isIn = True\",\"forEach(void action(K key, V value)) ‚Üí void :\",\"Applique la fonction donn√©e √† tous les √©l√©ments\",\"Ex :\",\"var planets = <int, String>{1: 'Mercury', 2: 'Earth'}; var isIn = planets.forEach((key, value) {print('$key: $value'); }); // La console affiche : // 1: Mercury // 2: Earth\",\"map<K, V>(MapEntry<K, V> convert(K key, V value)) ‚Üí Map<K, V> :\",\"Applique la fonction donn√©e √† tous les √©l√©ments et reconstruit un dictionnaire avec les r√©sultats\",\"Ex :\",\"var planets = <int, String>{1: 'Mercury', 2: 'Earth'}; var isIn = planets.map((key, value) => MapEntry(key, \\\"Plan√®te n¬∞ $key : $value\\\") }); // planets = {1: 'Plan√®te n¬∞ 1 : Mercury', 2: 'Plan√®te n¬∞ 2 : Earth'}\",\"putIfAbsent(K key, V ifAbsent()) ‚Üí V :\",\"Ajoute la cl√© et la valeur si la cl√© n'est pas dans le dictionnaire, sinon renvoie la valeur actuelle\",\"Ex :\",\"var planets = <int, String>{1: 'Mercury', 2: 'Earth'}; planets.putIfAbsent(3, () => 'Mars'); // planets = {1: 'Mercury', 2: 'Earth', 3 : 'Mars'} var res = planets.putIfAbsent(3, () => 'V√©nus'); // res = 'Mars' // planets = {1: 'Mercury', 2: 'Earth', 3 : 'Mars'}\",\"remove(Object? key) ‚Üí V? :\",\"Supprime la cl√© donn√©e et sa valeur\",\"Retourne la valeur supprim√©e\",\"Ex :\",\"var planets = <int, String>{1: 'Mercury', 2: 'Earth'}; var res = planets.remove(2); // res = 'Earth' // planets = {1: 'Mercury'}\",\"removeWhere(bool test(K key, V value)) ‚Üí void :\",\"Supprime toutes les cl√©s v√©rifiant la condition et leur valeur\",\"Ex :\",\"var planets = <int, String>{1: 'Mercury', 2: 'Earth'}; var res = planets.removeWhere((key, value) => value.startsWith('E')); // planets = {1: 'Mercury'}\",\"update(K key, V update(V value), {V ifAbsent()?}) ‚Üí V :\",\"Met √† jour la valeur associ√©e √† la cl√© donn√©e et retourne la nouvelle valeur\",\"Si la cl√© n'est pas dans le dictionnaire, le param√®tre ifAbsent doit √™tre renseign√© pour ajouter la paire cl√© / valeur\",\"Ex :\",\"var planets = <int, String>{1: 'Mercury', 2: 'Earth'}; var res = planets.update(1, (value) => 'V√©nus'); // res = 'V√©nus' // planets = {1: 'V√©nus', 2: 'Earth'} var res = planets.update(3, (value) => 'Mars', ifAbsent: () => 'Neptune'); // res = 'Neptune' // planets = {1: 'V√©nus', 2: 'Earth', 3 : 'Neptune'}\",\"updateAll(V update(K key, V value)) ‚Üí void :\",\"Met √† jour les paires cl√© / valeur en appliquant la fonction donn√©e\",\"Ex :\",\"var planets = <int, String>{1: 'Mercury', 2: 'Earth'}; planets.updateAll((key, value) => value.toUpperCase()); // planets = {1: 'MERCURY', 2: 'EARTH'}\"]},\"196\":{\"h\":\"Op√©rations usuelles\"},\"197\":{\"h\":\"Op√©ration arithm√©tique\",\"t\":[\"+ : addition\",\"- : soustraction\",\"-x : inversion de signe\",\"* : multiplication\",\"/ : division\",\"~/ : division enti√®re\",\"% : reste d'une division enti√®re\",\"++ : Incr√©mentation\",\"-- : D√©cr√©mentation\"]},\"198\":{\"h\":\"Comparaison\",\"t\":[\"> : Plus grand que\",\"< : Plus petit que\",\">= : Plus grand que ou √©gal √†\",\"<= : Plus petit que ou √©gal √†\",\"== : √âgal\",\"!= : Diff√©rent\"]},\"199\":{\"h\":\"V√©rification de type\",\"t\":[\"is : V√©rifie si la variable est du type demand√© \",\"Ex :\",\"var n = 2; if (n is int) { ... }\",\"is! : V√©rifie si la variable n'est pas du type demand√©\"]},\"200\":{\"h\":\"Op√©ration d'assignation\",\"t\":[\"= : Assignation simple\",\"??= : Assignation uniquement si la variable est nulle \",\"Ex :\",\"var n; var m = 1; n ??= 2; // n = 2 m ??= 2; // m = 1\",\"+= : Assignation avec addition\",\"-= : Assignation avec soustraction\",\"*= : Assignation avec multiplication\",\"/= : Assignation avec division\",\"~/= : Assignation avec division enti√®re\",\"%= : Assignation du reste de la division enti√®re\"]},\"201\":{\"h\":\"Op√©ration logique\",\"t\":[\"&& : Et\",\"|| : Ou\",\"! : Non\"]},\"202\":{\"h\":\"Op√©ration conditionnelle\",\"t\":[\"\\\"cond ? expr1 : expr2\\\" Si la condition cond est vrai, le r√©sultat est expr1, sinon le r√©sultat est expr2\",\"\\\"expr1 ?? expr2\\\" fait expr1 si expr1 est non nul, expr2 sinon\",\"site : https://www.youtube.com/watch?v=lytQi-slT5Y&list=PLjxrf2q8roU23XGwz3Km7sQZFTdB996iG&ab_channel=Flutter\"]},\"203\":{\"c\":[\"Guide\"]},\"204\":{\"h\":\"Gestion erreurs\"},\"205\":{\"h\":\"AppException\",\"t\":[\"La classe AppException est une extension de Exception, qui permet de g√©rer les erreurs de l'application. Elle a deux attributs :\",\"type : le type d'erreur parmi les types pr√©d√©finis dans la classe ErrorType : \",\"tokenExpire\",\"notFound\",\"invalidData\",\"message : le message d'erreur\"]},\"206\":{\"c\":[\"Guide\"]},\"207\":{\"h\":\"Module exemple\",\"t\":[\"‚ùó Cette page n'est pas √† jour, le routage √† chang√©, Il faut suivre la doc du routage pour avoir une navigation compatible\",\"Cette partie d√©taille pas √† pas la cr√©ation du module de pr√™t.\"]},\"208\":{\"h\":\"1. Cr√©ation des dossiers\",\"t\":[\"Tout est dans le nom üòâ\"]},\"209\":{\"h\":\"2. Les classes du module\",\"t\":[\"Normalement, le module communique avec l'API, il faut donc cr√©e les classes desquelles on pourra cr√©e les repositories et les providers.\",\"Si l'API fournit le json avec les donn√©es, vous pouvez utiliser https://www.jsontodart.in/ pour cr√©e automatiquement les classes. Cet outil ne fait pas tout, en particulier il ne g√©re pas les DateTime. Il faut donc le faire √† la main, avec la fonction processDate dans tools/functions.dart.\",\"String processDate(DateTime date) { return date.toIso8601String(); }\",\"Si les endpoints de l'API ne sont pas encore cr√©√©s, vous pouvez quand m√™me faire ces parties, il faudra juste tout v√©rifier, une fois les endpoints termin√©s.\",\"Exemple : loan/class/loan.dart\",\"class Loan { Loan({ required this.id, required this.borrowerId, required this.notes, required this.start, required this.end, required this.association, required this.caution, }); late final String id; late final String borrowerId; late final String notes; late final String start; late final String end; late final String association; late final bool caution; Loan.fromJson(Map<String, dynamic> json) { id = json['id']; borrowerId = json['borrower_id']; notes = json['notes']; start = DateTime.parse(json['start']); // On convertit le String en DateTime end = DateTime.parse(json['end']); association = json['association']; caution = json['caution']; } Map<String, dynamic> toJson() { final _data = <String, dynamic>{}; _data['id'] = id; _data['borrower_id'] = borrowerId; _data['notes'] = notes; _data['start'] = processDate(start); // On convertit le DateTime en String _data['end'] = processDate(end); _data['association'] = association; _data['caution'] = caution; return _data; } // Cette fonction est √† ajouter √† la main Loan copyWith({id, borrowerId, notes, start, end, association, caution}) { return Loan( id: id ?? this.id, borrowerId: borrowerId ?? this.borrowerId, notes: notes ?? this.notes, start: start ?? this.start, end: end ?? this.end, association: association ?? this.association, caution: caution ?? this.caution); } }\"]},\"210\":{\"h\":\"3. Les repositories\",\"t\":[\"On cr√©e les repositories qui permettent de r√©cup√©rer les donn√©es depuis l'API. Pour ce faire, il faut conna√Ætre les endpoints de l'API. Il faut cr√©e un repository pour chaque groupe d'endpoint. Par exemple dans le cas du module de pr√™t, il y a des endpoints loans/ (avec un id ou non) et des endpoints loans/item/. On cr√©e donc deux repositories.\",\"Exemple : loan/repositories/item_repository.dart\",\"import 'package:myecl/loan/class/item.dart'; import 'package:myecl/tools/repository/repository.dart'; class ItemRepository extends Repository { @override // ignore: overridden_fields final ext = \\\"loans/loaners/\\\"; Future<List<Item>> getItemList(String loanerId) async { return List<Item>.from((await getList(suffix: loanerId + \\\"/items\\\")).map((x) => Item.fromJson(x))); } Future<Item> createItem(String loanerId, Item item) async { return Item.fromJson(await create(item.toJson(), suffix: loanerId + \\\"/items\\\")); } Future<bool> updateItem(String loanerId, Item item) async { return await update(item.toJson(), loanerId + \\\"/items/\\\" + item.id); } Future<bool> deleteItem(String loanerId, String itemId) async { return await delete(loanerId + \\\"/items/\\\" + itemId); } }\",\"On fait h√©riter le repository de la classe Repository, d√©finie dans tools/repository/repository.dart. De cette mani√®re, on √©limine √©norm√©ment de la redondance.\",\"Les fonctions de Repository ne prennent et renvoient que des String ou des List<String>, c'est pour cela que les fonctions de ItemRepository doivent faire les conversions.\",\"La classe Repository contient 6 fonctions.\",\"getList : r√©cup√®re la liste des √©l√©ments\",\"create : cr√©e un √©l√©ment\",\"update : met √† jour un √©l√©ment\",\"delete : supprime un √©l√©ment\",\"getOne : r√©cup√®re un √©l√©ment\",\"setToken : permet de d√©finir le token pour les requ√™tes\",\"Cettte classe a √©t√© cod√©e pour rendre plus facile et plus lisible les codes des repositories. Je conseille fortement de s'en servir.\"]},\"211\":{\"h\":\"4. Les providers\",\"t\":[\"A partir des repositories, on cr√©e les providers qui permettront l'interaction entre l'utilisateur et la base de donn√©e. Il faut au moins autant de providers que de repositories. Cependant, il est tr√®s courant d'en avoir bien plus. Par exmple, l'endpoint loans/history/ (que j'ai mis dans le repository loanrepository.dart, ce qui peut √™tre discutable) demande son provider car il ne manipule pas les m√™mes donn√©es que le provider _loan_list_provider.dart.\",\"La r√®gle est qu'un provider manipule toujours le m√™me type de donn√©es. Il en faut donc un pour la liste des pr√™ts, un pour la liste des objets, un pour le d√©tail d'un pr√™t (endpoints loans/{loan_id}), puisque son type est Loan et non List<Loan>, et un pour l'historique car la liste des pr√™ts est diff√©rentes de celle des pr√™ts en cours.\",\"Exempe : loan/providers/item_list_provider.dart\",\"import 'package:flutter_riverpod/flutter_riverpod.dart'; import 'package:titan/loan/class/item.dart'; import 'package:titan/loan/providers/loaner_id_provider.dart'; import 'package:titan/loan/repositories/item_repository.dart'; import 'package:titan/tools/providers/list_notifier.dart'; import 'package:titan/tools/token_expire_wrapper.dart'; class ItemListNotifier extends ListNotifier<Item> { final ItemRepository itemrepository; ItemListNotifier({required this.itemrepository}) : super(const AsyncValue.loading()); Future<AsyncValue<List<Item>>> loadItemList(String id) async { return await loadList(() async => itemrepository.getItemList(id)); } Future<bool> addItem(Item item, String loanerId) async { return await add((i) async => itemrepository.createItem(loanerId, i), item); } Future<bool> updateItem(Item item, String loanerId) async { return await update( (i) async => itemrepository.updateItem(loanerId, i), (items, item) => items..[items.indexWhere((i) => i.id == item.id)] = item, item, ); } Future<bool> deleteItem(Item item, String loanerId) async { return await delete( (id) async => itemrepository.deleteItem(loanerId, id), (items, item) => items..removeWhere((i) => i.id == item.id), item.id, item, ); } Future<AsyncValue<List<Item>>> copy() async { return state.whenData((d) => d.sublist(0)); } Future<AsyncValue<List<Item>>> filterItems(String query) async { return state.whenData( (items) => items .where( (item) => item.name.toLowerCase().contains(query.toLowerCase()), ) .toList(), ); } } final itemListProvider = StateNotifierProvider<ItemListNotifier, AsyncValue<List<Item>>>((ref) { final itemRepository = ref.watch(itemRepositoryProvider); ItemListNotifier itemListNotifier = ItemListNotifier( itemrepository: itemRepository, ); tokenExpireWrapperAuth(ref, () async { final loanerId = ref.watch(loanerIdProvider); if (loanerId != \\\"\\\") { await itemListNotifier.loadItemList(loanerId); } }); return itemListNotifier; });\",\"Encore une fois, on h√©rite de la classe ListNotifier pour pouvoir utiliser les m√©thodes de la classe. On passe en premier argument, la fonction du repository que l'on veut utiliser.\",\"Enfin, on r√©cup√®re le token d'authorization gr√¢ce au provider tokenProvider, que l'on passe en argument du constructeur du notifier.\"]},\"212\":{\"h\":\"5. Le router\",\"t\":[\"Tout est expliqu√© dans le tutoriel sur le routage\"]},\"213\":{\"h\":\"6. Les pages\",\"t\":[\"On fait ici le front de chaque page.\",\"On commence par cr√©er un template pour toutes les pages du module\",\"class LoanTemplate extends StatelessWidget { final Widget child; const LoanTemplate({super.key, required this.child}); @override Widget build(BuildContext context) { return SafeArea( child: Column( children: [ const TopBar( title: LoanTextConstants.loan, root: LoanRouter.root, ), Expanded(child: child) ], ), ); } }\",\"Ce template ajoute une topbar qui g√®re les retours au clic du bouton (cf widget custom de Titan). Mettez le comme premier widget dans chacune de vos pages.\",\"Cr√©ez ensuite un dossier dans ui par page (ex admin_page pour la page d'administration du module).\",\"Le fichier contenant la page d'appelera ici admin_page.dart, et tous les fichiers dans ce dossier seront des widget utiles √† la construction de cette page.\",\"Si certains de vos widget sont utiles √† plusieurs pages, placez-les dans le dossier components\",\"N'oubliez pas de faire appel √† QR pour passer d'une page √† l'autre\",\"// Pour aller sur une page QR.to(LoanRouter.root + ...); //... // Pour revenir en arri√®re QR.back();\",\"Les parties suivantes d√©taillent des conseils pour la cr√©ation de vos pages.\"]},\"214\":{\"h\":\"7. Les Formulaires\",\"t\":[\"Il est tr√®s probable (voir certain) que votre module contienne une partie administrateur qui pourra manipuler des objets du module (par exemple les pr√™ts du module de pr√™t). Dans ce cas, vous aurez √† cr√©er un formulaire pour a minima cr√©e l'objet, voir le modifier. L'impl√©mentation de ces formulaires que je propose n'est pas optimale (le formulaire de modification surtout) en raison de probl√®me de rafra√Æchissement que je d√©taillerais, mais c'est pour l'instant la seule solution que j'ai pu faire fonctionner.\",\"Exemple d'un formulaire d'ajout d'objet (Je ne d√©taille que les diff√©rents types de champs qui peuvent √™tre n√©cessaire, le reste du code est dans des fichiers tels que add_item_page.dart).\"]},\"215\":{\"h\":\"Le formulaire textuel\",\"t\":[\"Utiliser un TextEntry (cf widget custom de Titan)\"]},\"216\":{\"h\":\"Le formulaire de date\",\"t\":[\"Utiliser un DateEntry (cf widget custom de Titan)\"]},\"217\":{\"h\":\"Le formulaire √† choix unique\",\"t\":[\"final loaner = useState(ref.watch(loanerProvider)); ... Column( children: listLoaner .map( (e) => RadioListTile( title: Text(e.name), selected: loaner.value.name == e.name, value: e.name, groupValue: loaner.value.name, onChanged: (s) { loaner.value = e; }), ) .toList() ),\",\"Ici, listLoaner est de type List<Loaner> et loaner est provider local √† cause du useState (pour √©viter d'avoir √† recr√©er un StateNotifier uniquement pour un fichier\"]},\"218\":{\"h\":\"Le formulaire √† choix multiple\",\"t\":[\"Column( children: itemList .map( (e) => CheckboxListTile( title: Text(e.name), value: ..., onChanged: (s) { ... } }, ), ) .toList(); )\",\"Ce formulaire est une colonne de CheckBox, value indique si la case doit √™tre coch√©e, et onChanged est un fonction qui est lanc√©e quand l'ulisatueur coche ou d√©coche la case.\"]},\"219\":{\"h\":\"8. Le Pull-to-refresh\",\"t\":[\"Le pull-to-refresh permet de rafra√Æchir le contenur d'une page en scrollant vers le bas. Puisque les impl√©mentations diff√©rent en fonction des plateformes, j'ai cr√©√© une classe faisant la disjonction de cas, dans le ficher tools/refresher.dart. Passez en argument la zone que vous voulez rendre rafra√Æchissable et une fonction asynchrone onRefresh. Cette fonction doit √™tre une fonction d'un provider (celle appel√©e √† l'initialisation de celui-ci, car seules ces donn√©es ont pu changer en temps).\"]},\"220\":{\"h\":\"9. Le Dialog\",\"t\":[\"Pour les fonctions qui vont avoir un impact irr√©versible sur la base de donn√©e, il est bon d'avoir une pop-up de confirmation avant d'ex√©cuter ces-derni√®res. Pour ce faire, utilisez la classe Dialog dans tools/functions.dart, en pr√©cisant le titre, la description la fonction asynchrone quand on appuie sur \\\"Oui\\\" (cf widget custom de Titan). Pr√©cisez dans vos pages la fonction √† ex√©cuter une fois la pop-up confirm√©e.\"]},\"221\":{\"h\":\"10. Le Toast\",\"t\":[\"Les Toasts sont des messages qui apparaissent apr√®s un ajout, une modification, une suppression d'un objet ou tout autre interaction avec la base de donn√©e pour indiquer si l'op√©ration s'est bien d√©roul√©e ou dans le cas contraire pourquoi.\",\"Exemple d'utilisation dans loan/ui/pages/add_loan_page/add_loan_page.dart:\",\"displayToast(context, TypeMsg.error, LoanTextConstants.invalidDates);\"]},\"222\":{\"c\":[\"Guide\"]},\"223\":{\"h\":\"Les Hooks\",\"t\":[\"Leur principale utilisation est de simplifier la gestion des √©tats en s'affranchissant des StatefulWidgets. Ils seront utilis√©s pour des variables limit√©es √† un seul fichier .dart, principalement des formulaires ou des animations.\",\"L'id√©e est de cr√©er une variable dont on peut modifier la valeur, et que cette modification entra√Æne un reconstruction de la page.\",\"final compteur = useState(0); // compteur est un Hook print(compteur.value); // 0 compteur.value = 1; // modifie la valeur de la variable print(compteur.value); // 1\",\"Il y a des Hooks sp√©cifiques pour certaines utilisations :\",\"useState : permet de g√©rer les variables\",\"useTextEditingController : permet de g√©rer les champs de saisie de texte\",\"useAnimationController : permet de g√©rer les animations\",\"usePageController : permet de g√©rer les pages\",\"...\",\"L'utilisation des Hooks n√©cessite d'utiliser le package :\",\"import 'package:flutter_hooks/flutter_hooks.dart';\",\"et de transformer un StateLessWidget en HookWdiget :\",\"Voici le code de l'application pr√©c√©dente, modifi√©e pour int√©grer les Hooks :\",\"class MyHomePage extends HookWidget { const MyHomePage({Key? key, required this.title}) : super(key: key); final String title; @override Widget build(BuildContext context) { final _counter = useState(0); return Scaffold( appBar: AppBar( title: Text(title), ), body: Center( child: Column( mainAxisAlignment: MainAxisAlignment.center, children: <Widget>[ const Text( 'You have pushed the button this many times:', ), Text( '${_counter.value}', style: const TextStyle(fontSize: 20), ), ], ), ), floatingActionButton: FloatingActionButton( onPressed: () => _counter.value++, tooltip: 'Increment', child: const Icon(Icons.add), ), ); } }\",\"On peut remarquer plusieurs choses dans ce nouveau code (qui donne la m√™me application par ailleurs):\",\"Il n'y a plus qu'un seul Widget qui est cr√©√©, c'est le HookWidget\",\"title est acc√©d√© comme dans le StatefulWidget dans le code pr√©c√©dent, on ne peut toujours pas le modifier.\",\"On cr√©e le compteur comme √©tant final, ce qui peut para√Ætre contre-intuitif, mais _counter est un Hook, qui est initialis√© une seule fois, est c'est _counter.value qui est un entier, valant initialement 0, qui est modifi√© par le bouton.\",\"On remarque enfin que ce code est plus concis et plus lisible que le code pr√©c√©dent, ce qui est une des principales motivations de l'utilisation des Hooks.\"]},\"224\":{\"c\":[\"Guide\"]},\"225\":{\"h\":\"Installer une librairies\",\"t\":[\"Avant de continuer, il est n√©cessaire de savoir installer des librairies externes, car elles √©viteront de recr√©er des Widgets d√©j√† existant.\",\"Nous allons installer une librairie externe, nomm√©e flutter_hooks indispensable pour la partie suivante.\",\"Pour ce faire, il faut ouvrir le fichier pubspec.yaml dans le dossier de l'application.\",\"Il y a ensuite deux mani√®re de faire :\",\"Manuellement :\",\"Rechercher la derni√®re version de la librairie dans le repository\",\"L'ajouter au fichier pubspec.yaml en ajoutant la ligne fl√©ch√©e suivante :\",\" flutter: sdk: flutter -> flutter_hooks: <La version trouv√©e> cupertino_icons: ^0.1.0\",\"Puis de lancer la commande flutter pub get\",\"A l'aide d'une extension VSCode:\",\"Installer l'extension Pubspec Assist\",\"Lancer la et rechercher flutter_hooks\",\"L'extension va automatiquement installer la librairie flutter_hooks\",\"Puis de lancer la commande flutter pub get ou de cliquer sur l'ic√¥ne de t√©l√©chargement en haut √† droite de la fen√™tre du fichier.\"]},\"226\":{\"c\":[\"Guide\"]},\"227\":{\"h\":\"Riverpod / Providers\",\"t\":[\"Cette partie est surement la plus technique, mais ces outils sont vraiment tr√®s utiles et simplifient √©norm√©ment le reste.\",\"Pour comprendre la simplification que cela permet, il faut voir que les StatefulWidgets ont un gros probl√®me quand les variables doivent √™tre utilis√©es dans plusieurs widget √† la fois. Par exemple, dans le module AMAP, la page principale permet d'afficher les commandes de l'utilisateur, elle a donc besoin de conna√Ætre la liste des commandes. Mais les pages pour modifier ou ajouter des commandes sont beaucoup plus loin dans la cha√Æne des Widgets, et il faudrait alors passer la liste des commandes en param√®tres d'une dizaine de Widgets successifs pour que tout fonctionne, ce qui rend le code de ces Widgets plus lourd et compliqu√© pour rien. Les providers sont une r√©ponse √† ce probl√®me.\"]},\"228\":{\"h\":\"Explication des providers\",\"t\":[\"Les providers sont des sortes de variable globale de l'application. Ils peuvent √™tre import√© dans n'importe quel Widget ind√©pendemment du widget parent, ce qui permet d'√©viter la longue cha√Æne de StatefulWidget. Flutter propose de nombreuses biblioth√®ques de provider. Celle utilis√©e par MyECL est Riverpod (flutter_riverpod).\",\"Dans Titan, chaque provider h√©rite de la classe StateNotifierProvider<Notifier,Type>, cette classe a la particularit√© de ne poss√©der qu'un seul attribut state contenant la valeur du provider. Le state d'un provider ne peut √™tre modifier qu'√† travers les m√©thodes d'une classe h√©ritant de StateNotifier<Type>, on appelle cette classe un \\\"notifier\\\". C'est la modification du state dans les m√©thodes du notifier qui va pr√©venir les diff√©rents widgets utilisant le provider pour leur dire de s'actualiser.\",\"Pour illustrer tout √ßa, voici le code d'un provider ayant simplement pour but de garder en m√©moire entre plusieurs pages un Advert (une annonce) sur le module Annonce :\",\"import 'package:flutter_riverpod/flutter_riverpod.dart'; import 'package:myecl/advert/class/advert.dart'; class AdvertNotifier extends StateNotifier<Advert> { AdvertNotifier() : super(Advert.empty()); void setAdvert(Advert i) { state = i; } } final advertProvider = StateNotifierProvider<AdvertNotifier, Advert>((ref) { return AdvertNotifier(); });\",\"D√©taillons ce code ensemble :\",\"import package:flutter_riverpod/flutter_riverpod.dart';\",\"Nous permet d'importer les classes StateNotifier et StateNotifierProvider\",\"class AdvertNotifier extends StateNotifier<Advert> { AdvertNotifier() : super(Advert.empty());\",\"On commence par cr√©er notre notifier, la classe AdvertNotifier qui h√©rite de StateNotifier. On pr√©cise entre chevrons (<Advert>) que le state de notre provider contiendra un objet de type Advert. L'objet contenu entre les parenth√®ses du super(...) correspond au state par d√©faut de notre provider, ici un Advert vide (c'est la synthaxe du constructeur en dart).\",\" void setAdvert(Advert i) { state = i; }\",\"Notre provider poss√®de une unique m√©thode setAdvert, lorsqu'elle est appell√©e, le state du provider est modifi√© par l'Advert en argument, ce qui va notifier tout les widgets utilisant ce provider pour qu'ils se mettent √† jour.\",\" final advertProvider = StateNotifierProvider<AdvertNotifier, Advert>((ref) { return AdvertNotifier(); });\",\"Enfin, on d√©fini notre provider qui h√©rite de StateNotifierProvider. On utilise le constructeur StateNotifierProvider<Notifier,Type>() pour d√©finir notre provider. On lui sp√©cifie entre crochet le type (la classe) du notifier et le type du state, on lui fourni dans les parenth√®ses une fonction qui retourne l'objet correspondant √† notre classe AdvertNotifier.\",\"Maintenant si on veut utiliser notre provider dans un autre fichier il faut importer notre provider :\",\"import 'package:myecl/advert/providers/advert_provider.dart';\",\"Le StatelessWidgets utilis√© jusque l√† doit √™tre remplac√© par un ConsumerWidget et il faut dire √† notre interface de s'actualiser lors d'un changement dans le state du provider :\",\"final advert = ref.watch(advertProvider);\",\"La variable advert contient l'√©tat du provider et la clause ref.watch(advertProvider) \\\"surveille\\\" les √©ventuelles changements dans l'√©tat du provider pour provoquer l'actualisation du widget.\",\"Enfin, pour pouvoir appliquer des modifications √† l'√©tat du provider, il faut utiliser le notifier :\",\"final advertNotifier = ref.watch(advertProvider.notifier);\",\"Qu'on utilise de cette mani√®re :\",\"advertNotifier.setAdvert(advert);\",\"Concr√™tement, le code notre page ressemblerait √† √ßa :\",\"import 'package:flutter/material.dart'; import 'package:hooks_riverpod/hooks_riverpod.dart'; import 'package:myecl/advert/providers/advert_provider.dart'; import 'package:myecl/advert/ui/pages/advert.dart'; ... class AdvertAddEditAdvertPage extends HookConsumerWidget { const AdvertAddEditAdvertPage({super.key}); @override Widget build(BuildContext context, WidgetRef ref) { final advert = ref.watch(advertProvider); final advertNotifier = ref.watch(advertProvider.notifier); ... return AdvertTemplate( ... ); } }\"]},\"229\":{\"h\":\"Les providers comme lien entre UI et API\",\"t\":[\"Dans Titan, il est souvant n√©cessaire de r√©cuperer des informations depuis l'API d'Hyperion. Les classes et les repositories nous permettent la r√©cup√©ration de ces infos mais aimerait pouvoir les conserver au cours de notre utilisation de l'appli sans avoir besoin de les demander √† Hyperion √† chaque changement de page.\",\"Il est possible d'utilliser des providers pour la gestion de nos objets API. Les m√©thodes du notifier permettent de g√©rer les diff√©rents √©tats des requ√™tes API et surtout d'actualiser nos objets en cons√©quence.\",\"Exemple : Un provider contient la liste des Sessions du module cin√©ma et on veut en ajouter une en base de donn√©e. Une solution pourrait √™tre de faire la requ√™te d'ajout et de charger ensuite toutes les sessions depuis Hyperion pour mettre √† jour notre provider. Une solution plus propre, serait de mettre √† jour ou non la liste du provider directement gr√¢ce au r√©sultat de la requ√™te d'ajout.\",\"C'est pour simplifier ces traitements que nous avons cr√©√© des templates de notifier, disponibiles dans les lib/tools/providers/ : SingleNotifier, ListNotifier, MapNotifier. Il suffit alors d'h√©riter de ces classes pour faciliter les appels API.\",\"Voici, par exemple, le code du ListNotifier :\",\"import 'package:hooks_riverpod/hooks_riverpod.dart'; import 'package:myecl/tools/exception.dart'; abstract class ListNotifier<T> extends StateNotifier<AsyncValue<List<T>>> { ListNotifier(AsyncValue state) : super(const AsyncLoading()); Future<AsyncValue<List<T>>> loadList(Future<List<T>> Function() f) async { try { final data = await f(); state = AsyncValue.data(data); return state; } catch (e) { state = AsyncValue.error(e, StackTrace.current); if (e is AppException && e.type == ErrorType.tokenExpire) { rethrow; } else { return state; } } } Future<bool> add(Future<T> Function(T t) f, T t) async { return state.when(data: (d) async { try { final newT = await f(t); d.add(newT); state = AsyncValue.data(d); return true; } catch (error) { state = AsyncValue.data(d); if (error is AppException && error.type == ErrorType.tokenExpire) { rethrow; } else { return false; } } }, error: (error, s) { if (error is AppException && error.type == ErrorType.tokenExpire) { throw error; } else { state = AsyncValue.error(error, s); return false; } }, loading: () { state = const AsyncValue.error(\\\"Cannot add while loading\\\", StackTrace.empty); return false; }); } Future<bool> addAll( Future<List<T>> Function(List<T> listT) f, List<T> listT) async { return state.when(data: (d) async { try { final newT = await f(listT); d.addAll(newT); state = AsyncValue.data(d); return true; } catch (error) { state = AsyncValue.data(d); if (error is AppException && error.type == ErrorType.tokenExpire) { rethrow; } else { return false; } } }, error: (error, s) { if (error is AppException && error.type == ErrorType.tokenExpire) { throw error; } else { state = AsyncValue.error(error, s); return false; } }, loading: () { state = const AsyncValue.error( \\\"Cannot addAll while loading\\\", StackTrace.empty); return false; }); } Future<bool> update(Future<bool> Function(T t) f, List<T> Function(List<T> listT, T t) replace, T t) async { return state.when(data: (d) async { try { final value = await f(t); if (!value) { return false; } d = replace(d, t); state = AsyncValue.data(d); return true; } catch (error) { state = AsyncValue.data(d); if (error is AppException && error.type == ErrorType.tokenExpire) { rethrow; } else { return false; } } }, error: (error, s) { if (error is AppException && error.type == ErrorType.tokenExpire) { throw error; } else { state = AsyncValue.error(error, s); return false; } }, loading: () { state = const AsyncValue.error( \\\"Cannot update while loading\\\", StackTrace.empty); return false; }); } Future<bool> delete(Future<bool> Function(String id) f, List<T> Function(List<T> listT, T t) replace, String id, T t) async { return state.when(data: (d) async { try { final value = await f(id); if (!value) { return false; } d = replace(d, t); state = AsyncValue.data(d); return true; } catch (error) { state = AsyncValue.data(d); if (error is AppException && error.type == ErrorType.tokenExpire) { rethrow; } else { return false; } } }, error: (error, s) { if (error is AppException && error.type == ErrorType.tokenExpire) { throw error; } else { state = AsyncValue.error(error, s); return false; } }, loading: () { state = const AsyncValue.error( \\\"Cannot delete while loading\\\", StackTrace.empty); return false; }); } }\",\"Pour r√©sum√© (et parce qu'il n'est pas n√©cessaire de comprendre chaque ligne de code pour l'utiliser), le notifier poss√®de des m√©thodes loadList, add, addAll, update et delete. Ces m√©thodes sont charg√©es de :\",\"faire des appels API\",\"g√©rer les exceptions\",\"mettre √† jour le state en cons√©quence\",\"Et voici le code du provider associ√© √† la liste des Sessions du module cin√©ma :\",\"import 'package:flutter_riverpod/flutter_riverpod.dart'; import 'package:myecl/cinema/class/session.dart'; import 'package:myecl/cinema/repositories/session_repository.dart'; import 'package:myecl/tools/providers/list_notifier.dart'; import 'package:myecl/tools/token_expire_wrapper.dart'; class SessionListNotifier extends ListNotifier<Session> { final SessionRepository sessionRepository; SessionListNotifier({required this.sessionRepository}) : super(const AsyncValue.loading()); Future<AsyncValue<List<Session>>> loadSessions() async { return await loadList(sessionRepository.getAllSessions); } Future<bool> addSession(Session session) async { return await add(sessionRepository.addSession, session); } Future<bool> updateSession(Session session) async { return await update( sessionRepository.updateSession, (sessions, session) => sessions ..[sessions.indexWhere((b) => b.id == session.id)] = session, session); } Future<bool> deleteSession(Session session) async { return await delete( sessionRepository.deleteSession, (sessions, session) => sessions..removeWhere((b) => b.id == session.id), session.id, session); } } final sessionListProvider = StateNotifierProvider<SessionListNotifier, AsyncValue<List<Session>>>( (ref) { final sessionRepository = ref.watch(sessionRepositoryProvider); SessionListNotifier notifier = SessionListNotifier( sessionRepository: sessionRepository, ); tokenExpireWrapperAuth(ref, () async { await notifier.loadSessions(); }); return notifier; });\",\"Dans sa forme globale, il est tr√®s similaire avec le provider vu pr√©c√©dement. Cette fois-ci, on initialise le notifier avec un sessionRepository permettant la r√©alisation des appels API (ligne 41-42). Avant de retourner le notifier, on cherche √† load les sessions dans le state (ligne 45).\"]},\"230\":{\"h\":\"Les impl√©mentations\",\"t\":[\"Les m√©thodes du SessionListNotifier sont des fonctions bas√©e sur les m√©thodes existantes du ListNotifier. Les fonctions du ListNotifier prennent en param√®tre :\",\"La fonctions r√©alisant l'appels API (ici, une m√©thode du repository)\",\"Quand c'est n√©cessaire, une fonction r√©alisant des modifications sur la liste\",\"Quand c'est n√©cessaire, l'objet de la requ√™te (ici, une session)\"]},\"231\":{\"h\":\"Les AsyncValues\",\"t\":[\"On remarque ensuite que le StateNotifier (impl√©ment√© dans le ListNotifier) est de type AsyncValue<List<Item>>. Une variale AsyncValue peut valoir trois choses :\",\"AsyncData<T> o√π T est le type sp√©cifi√© dans AsyncValue (ici, ce serait une list d'Item)\",\"AsyncError o√π l'on peut sp√©cifier un message d'erreur\",\"AsyncLoading\",\"Ce type de variable est tr√®s utile (voir indispensable) pour la communication avec une API, car elle permet de g√©rer tout les cas de figure (l'attente de la r√©ponse, l'erreur ou la donn√©e renvoy√©e). La seule fonction √† retenir au sujet de ces variables est .when(), qui permet de faire la disjonction de cas.\",\"Ainsi, state est une AsyncValue qui, si elle poss√®de des donn√©es, sont de type List<Item> (sp√©cifi√© par <Item> √† l'initialisation de ListNotifier.\"]},\"232\":{\"c\":[\"Guide\"]},\"233\":{\"h\":\"Routage Qlevar\"},\"234\":{\"h\":\"Introduction\",\"t\":[\"Sur Titan le routage de l'application √©tait g√©r√© par un syst√®me de provider et d'affichage de page en fonction de la valeur de ces derniers. Ce syst√®me, assez simple √† mettre en place (d'o√π son utilisation dans un premier temps), montre ses limites avec Titan web, puisque toutes les pages se situaient √† la racine, for√ßant ainsi le navigateur √† t√©l√©charger un seul fichier js tr√®s lourd. Le nouveau routage de l'application r√©soud ces probl√®mes en permettant de g√©rer des sous-routes et de diff√©rer le chargement des fichiers au moment o√π ils sont n√©cessaires.\",\"Ce document pr√©cise comment mettre en place / migrer vers le routage par qlevar_router.\"]},\"235\":{\"h\":\"Principaux composants\"},\"236\":{\"h\":\"Le router\",\"t\":[\"Le router est le composant qui g√®re le routage de l'application. Il comporte une liste de QRoute, qui sont les routes de l'application. Il est possible de d√©clarer des sous-routes, qui seront charg√©es au moment o√π elles sont n√©cessaires.\"]},\"237\":{\"h\":\"Les middlewares\",\"t\":[\"Les middlewares sont des fonctions qui sont appel√©es avant l'affichage d'une page. Elles permettent de v√©rifier si l'utilisateur a le droit d'acc√©der √† la page, et de rediriger l'utilisateur vers une autre page si ce n'est pas le cas.\"]},\"238\":{\"h\":\"Mise en place\"},\"239\":{\"h\":\"router.dart\",\"t\":[\"Le fichier router.dart est le fichier qui g√®re le routage de l'application. Il d√©clare les pages accessibles, sous quel route et avec quel restriction d'acc√®s.\",\"Exemple du router du module cin√©ma :\",\"class CinemaRouter { final ProviderRef ref; static const String root = '/cinema'; static const String admin = '/admin'; static const String addEdit = '/add_edit'; static const String detail = '/detail'; static final Module module = Module( name: \\\"Cin√©ma\\\", icon: HeroIcons.ticket, root: CinemaRouter.root, selected: false); CinemaRouter(this.ref); QRoute route() => QRoute( path: CinemaRouter.root, builder: () => const CinemaMainPage(), middleware: [AuthenticatedMiddleware(ref)], children: [ QRoute(path: admin, builder: () => const AdminPage(), middleware: [ AdminMiddleware(ref, isCinemaAdminProvider), ], children: [ QRoute(path: detail, builder: () => const DetailPage()), QRoute(path: addEdit, builder: () => const AddEditSessionPage()), ]), ], ); }\",\"On d√©clare ici les routes de l'application.\",\"On peut voir que la route admin est une sous-route de la route root. On peut √©galement voir que la route admin a deux sous-routes, detail et addEdit. On remarque √©galement que les routes admin, detail et addEdit ont un middleware. Ce middleware est appel√© avant l'affichage de la page, et permet de v√©rifier si l'utilisateur a le droit d'acc√©der √† la page. Si ce n'est pas le cas, le middleware peut rediriger l'utilisateur vers une autre page.\",\"L'AuthenticatedMiddleware v√©rifie que l'utilisateur est connect√©, et le redirige vers la page de connexion si ce n'est pas le cas. L'AdminMiddleware v√©rifie que l'utilisateur est administrateur du cin√©ma, et le redirige vers la page de connexion du cin√©ma si ce n'est pas le cas.\",\"Il est √† noter que les middlewares s'applique √† la route et √† toutes ses sous-routes.\",\"On notera √©galement que le router retourne le module, ce qui sera indispensable pour l'ajouter √† la side bar du drawer.\"]},\"240\":{\"h\":\"La suppression du routage par provider\",\"t\":[\"Cette √©tape est assez simple, il suffit de supprimer le provider de routage (ici cinema_page_provider.dart) et ces utilisations.\"]},\"241\":{\"h\":\"La mise en place du router\",\"t\":[\"Pour mettre en place le router, il faut remplacer tout le routage pr√©c√©dent par soit :\",\"QR.to(<La page √† afficher>) pour afficher une page\",\"QR.back() pour revenir √† la page pr√©c√©dente\",\"Exemple :\",\"On remplace :\",\"pageNotifier.setCinemaPage(CinemaPage.admin);\",\"par\",\"QR.to(CinemaRouter.root + CinemaRouter.admin);\",\"On ajoute les chemins, pour suivre la convention √©tablie dans le router :\"]},\"242\":{\"h\":\"Ajout du router du module dans le router principal\",\"t\":[\"On ajouter le router du module dans les routes du router principal, dans le fichier router.dart de l'application.\",\"Exemple :\",\"routes = [ // ... CinemaRouter(ref).route(), // ... ];\",\"On ajoute enfin le module au drawer (s'il doit l'√™tre) en l'ajoutant dans settings/providers/module_list_provider.dart:\",\"List<Module> allModules = [ // ... CinemaRouter.module, // ... ];\",\"Et voil√†, le routage est mis en place !\"]},\"243\":{\"c\":[\"Guide\"]},\"244\":{\"h\":\"Structure module\",\"t\":[\"Cette partie d√©taille la structure des modules. Chaque module de MyECL est contenu dans un dossier qui porte le nom du module. Ce dossier en contient au maximun 5 sous-dossiers :\",\"class : contient les classes du module\",\"repositories : contient les repositories du module\",\"providers : contient les providers du module\",\"ui : contient les widgets du module et la structure des pages du module \",\"components : contient des Widgets utilis√©s par plusieurs pages du modules\",\"pages : contient les pages du module\",\"tools : contient les outils du module (principalement des constantes textuelles et de couleurs du module)\"]},\"245\":{\"c\":[\"Guide\"]},\"246\":{\"h\":\"Gestion token\",\"t\":[\"Cette partie est indispensable pour faire fonctionner l'application, car la quasi-totalit√© des requ√™te demande un token d'autorisation. Ce token permet de savoir si l'utilisateur est authentifi√© ou non.\"]},\"247\":{\"h\":\"Le token d'autorisation et le refresh token\",\"t\":[\"L'API de MyECL suis les conventions, il s'agit donc d'un token de type Bearer. Ce token doit √™tre mis dans le header de chaque requ√™te. ce token est valide pendant 30 min. Au-del√† de ce delai il faut renouveler le token, gr√¢ce √† au refresh token. Ainsi, l'API n'envoie pas un token mais une paire, le token et le refresh token. L'application sauvegarde uniquement le refresh token dans un fichier, de sorte qu'au prochain lancement de l'application, le token d'autorisation sera automatiquement renouvel√©. Si la proc√©dure √©choue, principalement si le refresh token est expir√©, ou inexistant (√† la premi√®re connection par exemple), l'application demande √† l'utilisateur de se reconnecter, pour g√©n√©rer une nouvelle paire de token.\"]},\"248\":{\"h\":\"Rafraichissement du token d'authorisation\",\"t\":[\"Le dossier auth contient les fonctions permettant de g√©rer le token d'autorisation, mais vous n'aurez jamais √† vous servir de ces fonctions directement. Cependant, vous aurez forc√©ment besoin de r√©cup√©rer le token d'autorisation pour chaque requ√™te. Il est stock√© dans un Provider nomm√© tokenProvider :\",\"final token = ref.watch(tokenProvider);\",\"Il n'existe que deux cas de figure pour que l'application se rende compte que le token est expir√© :\",\"Le pull-to-refresh : Ici, l'utilisateur souhaite rafraichir la page, l'application redemande donc √† l'API les donn√©es, et cela peut √©chouer √† cause de l'expiration. Ce cas de figure est totalement g√©r√© par le Refresher. Cette classe fait partie des nombreuses classe que je vous incite √† utiliser dans vos modules, pour gagner du temps et √©viter d'avoir des erreurs que j'ai d√©j√† r√©solues.\",\"Un bouton : Ici, votre module fournit un bouton, qui communique indirectement avec l'API, par exemple pour ajouter un pr√™t. Dans ce cas, c'est √† vous d'inclure l'outil de rafraichissement du token dans votre fonction. Il faut encapsuler votre fonction du provider dans la fonction tokenExpireWrapper (dans tools/token_expire_wrapper.dart), qui rafra√Æchit le token si besoin est. Pour emp√™cher l'utilisateur de cliquer plusieurs fois sur le bouton, impl√©mentez un WaitingButton (dans tools/ui/shrink_button.dart)\",\"Exemple dans loan/ui/pages/item_group_page/add_edit_item_page.dart :\",\"if (key.currentState == null) { return; } if (key.currentState!.validate()) { await tokenExpireWrapper(ref, () async { Item newItem = Item( id: isEdit ? item.id : '', name: name.text, caution: int.parse(caution.text), suggestedLendingDuration: double.parse(lendingDuration.text), available: item.available); final value = isEdit ? await itemListNotifier.updateItem( newItem, loaner.id) : await itemListNotifier.addItem( newItem, loaner.id); ... } }); } else { displayToast(context, TypeMsg.error, LoanTextConstants.incorrectOrMissingFields); }\",\"Voici le code du wrapper dans tools/token_expire_wrapper.dart :\",\"Future tokenExpireWrapper(WidgetRef ref, Future<dynamic> Function() f) async { await f().catchError((error, stackTrace) async { final tokenNotifier = ref.watch(authTokenProvider.notifier); final askingRefreshTokenNotifier = ref.watch(askingRefreshTokenProvider.notifier); final askingRefreshToken = ref.watch(askingRefreshTokenProvider); if (error is AppException && error.type == ErrorType.tokenExpire) { if (askingRefreshToken) return; askingRefreshTokenNotifier.setbool(true); try { final value = await tokenNotifier.refreshToken(); if (value) { f(); } else { tokenNotifier.deleteToken(); } } catch (e) { tokenNotifier.deleteToken(); } askingRefreshTokenNotifier.setbool(false); } }); }\",\"Son but est de rep√©rer pr√©cis√©ment si l'erreur est due √† l'expiration du token, et, si besoin est, de le rafraichir, puis de relancer la fonction.\",\"Ce code recherche pr√©cisemment une erreur de type AppException, et si c'est le cas, il v√©rifie si l'erreur est due √† l'expiration du token. Si c'est le cas, il appelle la fonction de rafraichissement du token. Si cette derni√®re r√©ussie, tokenExpireWrapper relance la fonction. Sinon, elle renvoie √† la page de connexion.\",\"Le provider askingRefreshToken et son Notifier permettent de ne pas faire plusieurs fois la demande de rafra√Æchissement de token, qui serait refus√©e par l'API.\"]},\"249\":{\"c\":[\"Guide\"]},\"250\":{\"h\":\"Tutoriels\",\"t\":[\"Diff√©rents tutoriels pour prendre en main Titan\"]},\"251\":{\"c\":[\"Guide\"]},\"252\":{\"h\":\"Les Widgets\",\"t\":[\"C'est l'√©l√©ment de base de Flutter, toute l'application n'est qu'une imbrication de Widget les uns dans les autres.\",\"Dans le code pr√©c√©dent les Widgets sont imbriqu√©s comme suit :\",\"MyApp (= MaterialApp) <- MyHomePage (= Scaffold) <- Center <- Column <- List(Text)\",\"Les plus utilis√©s sont :\",\"MaterialApp : permet de cr√©e l'application (indispensable)\",\"Scaffold : permet de cr√©e un √©l√©ment de base pour l'application (indispensable)\",\"Container : L'√©l√©ment le plus modifiables de tous, il sert aussi bien pour placer un autre Widget que pour de la d√©coration\",\"Container( // L'apparance decoration: BoxDecoration( borderRadius: BorderRadius.circular(25), color: ColorConstant.darkGrey, boxShadow: const [ BoxShadow( color: ColorConstant.darkGrey, blurRadius: 10, offset: Offset(0, 5), ), ], ), // L'espacement entre l'ext√©rieur et le Widget margin: const EdgeInsets.all(15.0), // L'espacement entre le Widget et child padding: const EdgeInsets.only(left: 15.0, right: 15.0), child: ... ),\",\"Les Widgets Center, Align, Padding, ... sont des versions simplifi√©es de Container ne permettant de changer que certains param√®tres, d'o√π leurs noms.\",\"Column / Row / Stack : Permettent d'afficher des √©l√©ments les uns en-dessous / √† c√¥t√© / par dessus les autres\",\"Column( // le type d'espacement des √©l√©ments dans la direction de d√©filement mainAxisAlignment: MainAxisAlignment.center, // le type d'espacement des √©l√©ments dans la direction perpendiculaire crossAxisAlignment: CrossAxisAlignment.center, children: [...], ),\",\"(Pour Column et Row, il est possible d'utiliser le Widget Expanded, dont le comportement est de prendre toute la place disponible)\",\"Text / Icon : Permettent d'afficher de texte un ic√¥ne\",\"Text( 'Texte √† afficher', // le style du texte style: TextStyle( fontSize: 30, fontWeight: FontWeight.bold, color: Colors.white, ), ),\",\"(Il est important de remarquer que ces Widget n'ont pas de child, il sont donc mis en fin de cha√Æne d'imbrication, de plus child est optionel dans Container)\",\"GestureDetector / Inkwell / ElevatedButton : Trois type de boutons (avec / sans animation, gestion de plusieurs types d'√©v√®nement, ...)\",\"InkWell( splashColor: const Color.fromRGBO(255, 255, 255, 1), onTap: () { // La fonction √† lancer au clic }, child: ... )\",\"Form / TextFormField : Form permet de cr√©e un formulaire et TextFormField un champ de saisie pour l'utilisateur\",\"Form( child: TextFormField( style: const TextStyle( fontSize: 18, color: Colors.white, ), ), ),\",\"La liste est bien plus grande mais ces diff√©rents Widget permettent d√©j√† de cr√©er une grande vari√©t√© de page.\"]},\"253\":{\"h\":\"Les StateLessWidgets et StatefulWidgets\",\"t\":[\"Les StatelessWidgets sont des widgets qui n'ont aucun √©tat, i.e. qui ne sont cr√©es qu'√† la compilation du code. Tout ce qui est contenue dans un StatelessWidget doit donc √™tre harcod√© (il est impossible de changer du texte par exemple).\",\"Voici un exemple d'utilisation d'un StatelessWidget dans l'application cr√©√©e pr√©c√©demment :\",\"class MyApp extends StatelessWidget { const MyApp({Key? key}) : super(key: key); @override Widget build(BuildContext context) { return MaterialApp( title: 'Flutter Demo', theme: ThemeData( primarySwatch: Colors.blue, ), home: const MyHomePage(title: 'Flutter Demo Home Page'), ); } }\",\"Ici, tout est constant, on peut donc utiliser un StateLessWidget pour √©viter de recr√©er la page d√®s que l'utilisateur la demande.\",\"Les StatefulWidget peuvent prendre des arguments en entr√©e, et permettent donc beaucoup plus de chose. Le code ci-dessous est le StateFulWidget de l'application cr√©√©e.\",\" class MyHomePage extends StatefulWidget { const MyHomePage({Key? key, required this.title}) : super(key: key); final String title; @override State<MyHomePage> createState() => _MyHomePageState(); } class _MyHomePageState extends State<MyHomePage> { int _counter = 0; void _incrementCounter() { setState(() { _counter++; }); } @override Widget build(BuildContext context) { return Scaffold( appBar: AppBar( title: Text(widget.title), ), body: Center( child: Column( mainAxisAlignment: MainAxisAlignment.center, children: <Widget>[ const Text( 'You have pushed the button this many times:', ), Text( '$_counter', style: Theme.of(context).textTheme.headline4, ), ], ), ), floatingActionButton: FloatingActionButton( onPressed: _incrementCounter, tooltip: 'Increment', child: const Icon(Icons.add), ), ); } }\",\"On remarque plusieurs choses :\",\"On cr√©e en r√©alit√© deux classes (MyHomePage et _MyHomePageState)\",\"On peut effectivement fournir des arguments en entr√©e d'un StatefulWidget, qui sont d√©clar√©s et typ√©s (pr√©c√©d√©es de final) obligatoirement √™tre fournis √† l'instanciation (required), ou totalement d√©finies (pr√©c√©d√©es de static const, que l'on ne vois pas dans cet exemple).\",\"On peut acc√©der aux variables de MyHomePage depuis _MyHomePageState gr√¢ce √† widget., comme avec title, mais on ne peut pas les modifier.\",\"Les variables modifiables sont cr√©√©es et modifi√©es dans _MyHomePageState. Elles sont cr√©√©es comme des variables classiques, et ne sont modifiables qu'uniquement dans la fonction setState().\"]},\"254\":{\"c\":[\"Guide\"]},\"255\":{\"h\":\"Utilitaires, usage fr√©quents\"},\"256\":{\"c\":[\"Guide\"]},\"257\":{\"h\":\"Widget Customs\"},\"258\":{\"h\":\"Contexte\"},\"259\":{\"h\":\"Pourquoi les avoir cr√©√©s ?\",\"t\":[\"Ces Widgets ont pour but de faire gagner du temps √† tous ceux qui veulent travailler sur Titan, en √©vitant d'avoir √† copier coller des bouts de code d'autres modules, ce qui peut entra√Æner des erreurs et une redondance. Ils fournissent aussi une abstraction de certaines fonctionalit√©s qui peuvent √™tre complexe. La PR (Pull Request) qui a cr√©√© ces Widget a r√©duit la taille de code d'environ 7000 lignes soit 15% de la taille du projet.\"]},\"260\":{\"h\":\"Comment en ajouter ?\",\"t\":[\"Il faut consid√©rer la cr√©ation d'un Widget custom d√®s qu'un groupe de Widget est r√©p√©t√© au moins deux fois, avec quelques changements (par exemple la carte d'un objet, qui put avoir ou pas des boutons). De l√†, deux cas de figure :\",\"Soit ce Widget est exclusif au module, alors il doit √™tre plac√© dans le dossier ui/components du module.\",\"Soit l'ensemble de Widget dont on veux cr√©er un Widget custom existe d√©j√† (ou presque) dans au moins un autre module, alors ce Wdiget custom peut √™tre ajout√©s au Widget custom de Titan, en le pla√ßant l√† o√π il doit (la diff√©rence entre les trois dossier est expliqu√©e plus tard). Cet ajout doit faire l'objet d'une PR.\",\"Si le Widget √† cr√©er se rapproche √©norm√©ment d'un Widget existant, alors les modifications peuvent √™tre directement faites sur ce Widget custom. Cette modification doit √©galement faire l'objet d'une PR, ainsi que d'une v√©rification des utilisations de l'ancienne version du Widget et d'une mise √† jour de cette documentation.\"]},\"261\":{\"h\":\"Documentation\",\"t\":[\"Les diff√©rents Widgets sont r√©partis en trois cat√©gories, en fonction des param√®ters qu'ils acceptent. Les nombres d'utilisations ont √©t√© pris au moment o√π la branche qui a cr√©√© tous ces Widgets √† √©t√© merge. Ils sont l√† pour indiquer la fr√©quence d'utilisation et donner une id√©e desquels ils seraient bon de matr√Æser au plus vite.\"]},\"262\":{\"c\":[\"Guide\"]},\"263\":{\"h\":\"Premiers pas\"},\"264\":{\"c\":[\"Guide\"]},\"265\":{\"h\":\"Installation et configuration initiale\"},\"266\":{\"h\":\"0. Stack recommand√©e\",\"t\":[\"Git\",\"Fork (optionnel)\",\"VS Code (ou autre √©diteur de texte)\",\"Dart \",\"3.9.2 ou plus\",\"Flutter \",\"3.38 ou plus\",\"Pour pouvoir lancer Titan sur diff√©rentes plateforme, il te faut les outils suivants :\",\"Chrome pour le web\",\"Android Studio pour Android\",\"XCode pour IOS\",\"Pour v√©rifier que tout est bien install√©, lance\",\"flutter doctor\"]},\"267\":{\"h\":\"2. Installe les d√©pendances\",\"t\":[\"Rien de plus simple :\",\"flutter pub get\"]},\"268\":{\"h\":\"4. Compl√®te le ( )\",\"t\":[\"Important\",\"Commence par copier le .env.template dans un .env\",\"A savoir\",\"Ces fichiers template ont √©t√© soigneusement √©labor√©s pour marcher pour toi avec un minimum de changements personnels √† apporter, et quelques services pr√©-configur√©s.\"]},\"269\":{\"h\":\"Le fichier\",\"t\":[\"Info\",\"Le .env contient les variables d'environnement qui peuvent √™tre acc√©d√©es par l'application, √† savoir les URL des Hyperions sur lesquel Titan doit se connecter\",\"Si tu travailles en local, change DEV_HOST pour pointer sur l'adresse d'Hyperion que tu souhaite atteindre\"]},\"270\":{\"h\":\"5. Lance l'app\",\"t\":[\"Assez simple\",\"flutter run\",\"Tu peux te connecter via CalypSSO avec le compte que tu as cr√©√© c√¥t√© Hyperion, et voil√† !\"]},\"271\":{\"c\":[\"Guide\"]},\"272\":{\"h\":\"Introduction: pourquoi et quoi ? Concepts fondamentaux\"},\"273\":{\"h\":\"Introduction\",\"t\":[\"Titan est le front-end de MyECL, l'application √©tudiante de l'√âcole Centrale de Lyon. Si vous √™tes nouveau dans le d√©veloppement web ou applicatif, pensez au front-end comme au \\\"visuel\\\" d'une application : c'est lui qui affiche les donn√©es, les actions logique m√©tier, et r√©cup√®re les informations du back-end (la gestion des donn√©es).\"]},\"274\":{\"h\":\"Pourquoi Titan existe-t-il ?\"},\"275\":{\"h\":\"Le probl√®me √† r√©soudre\",\"t\":[\"Avant Titan, Eclair ne proposait pas d'application mobile, or les √©l√®ves se servent plus de leur t√©l√©phone que de leur ordinateur\"]},\"276\":{\"h\":\"Que fait concr√®tement Titan ?\",\"t\":[\"Etant un des client d'Hyperion, il permet de visualiser et d'agir sur les donn√©es d'Hyperion.\"]},\"277\":{\"h\":\"Gestion des utilisateurs et groupes\",\"t\":[\"Comptes √©tudiants : Compte utilisateur unique pour tous les services\",\"Groupes et associations : Gestion des BDE, clubs, associations\",\"Permissions : Qui peut faire quoi selon son statut\"]},\"278\":{\"h\":\"Services aux √©tudiants\",\"t\":[\"Actualit√©s et √©v√©nements : Diffusion d'informations\",\"R√©servations : Salles, mat√©riel, cr√©neaux\",\"Paiements : Via MyECLPay pour les cotisations, √©v√©nements\",\"Cin√©ma : Programmation et r√©servations\",\"Et beaucoup plus √† venir gr√¢ce √† vous !\"]},\"279\":{\"h\":\"Architecture technique : pourquoi ces choix ?\"},\"280\":{\"h\":\"Flutter comme framework multiplateforme\",\"t\":[\"Pourquoi Flutter ?\",\"Multiplateforme : L'un des seul framework pouvant √™tre port√© partout, donc une seul codebase\",\"De nombreuse libraires : Evites de tout recoder en partant de z√©ro\",\"Maintenue par Google : Pas d√©pr√©ci√©, sans cesse am√©lior√©\",\"Async natif : Gestion optimale de la concurrence\"]},\"281\":{\"h\":\"Riverpod comme state manager\",\"t\":[\"Qu'est ce qu'un state manager\",\"Un state manager permet de mettre √† jour le visuel en fonction des donn√©es, par exemple un loader en attendant qu'Hyperion r√©ponde, puis les donn√©es r√©cup√©r√©es ou une erreur.\",\"Pourquoi Riverpod ?\",\"Stancard de l'industrie : Fiable, utilis√© par tous\",\"Moins de boilerplate : Un composant utilisant Riverpod s'√©crit avec moins de code qui serait obligatoire sans\"]},\"282\":{\"h\":\"L'√©cosyst√®me MyECL\",\"t\":[\"Titan ne vit pas seul, il fait partie d'un √©cosyst√®me :\"]},\"283\":{\"h\":\"Applications clientes\",\"t\":[\"Hyperion (Python) : Le back-end unique\",\"Applications tierces : Autres services qui utilisent l'API\"]},\"284\":{\"h\":\"Exemple concret : la vie d'une requ√™te\",\"t\":[\"Imaginons qu'un √©tudiant veuille voir ses r√©servations de salle sur l'application\",\"Frontend : L'app mobile fait une requ√™te GET /bookings/me\",\"R√©ponse : Hyperion r√©pond apr√®s avoir fait ses op√©rations au frontend\",\"Repository : Le repository r√©cup√®re et transforme les donn√©es en objet Booking\",\"Provider : Le provider se met √† jour avec les nouvelles donn√©e\",\"UI : La couche visuelle \\\"regarde\\\" le provider et se met √† jour quand sa valeur change\",\"Future<List<Booking>> getUserBookingList() async { return List<Booking>.from( (await getList(suffix: \\\"/bookings/me\\\")).map((x) => Booking.fromJson(x)), ); }\",\"Le repository, qui fait la requ√™te et transforme la r√©ponse en object Booking\",\"Future<AsyncValue<List<Booking>>> loadUserBookings() async { return await loadList(bookingRepository.getUserBookingList); } ... await provider.loadUserBookings();\",\"Le provider, qui r√©cup√®re les donn√©es du repository, et qui met √† jour son √©tat interne. Dans le cas d'ajout, de modification ou de suppression, le state se met aussi √† jour automatiquement avec les changements\",\"final bookings = ref.watch(userBookingListProvider);\",\"C√¥t√© visuel, on regarde la valeur interne du provider, et d√®s qu'elle change, on reconstruit\",\"Info\",\"Les fonctions pr√©sent√© ici ne font pas tout, ce sont les fonctions comme getList, loadList qui se charge de g√©rer les conversions de donn√©es, les erreurs et la mise √† jour des √©tats internes, il faut donc les utiliser.\"]},\"285\":{\"h\":\"Concepts cl√©s √† retenir\"},\"286\":{\"h\":\"Application\",\"t\":[\"Titan utilise une API REST : un ensemble d'endpoints HTTP qui permettent d'int√©ragir avec Hyperion pour :\",\"Cr√©er des donn√©es (POST)\",\"Lire des donn√©es (GET)\",\"Modifier des donn√©es (PUT/PATCH)\",\"Supprimer des donn√©es (DELETE)\"]},\"287\":{\"h\":\"State manager\",\"t\":[\"Garder: les donn√©es r√©cup√©r√©es d'Hyperion\",\"Mettre √† jour : automatiquement le visuel\"]},\"288\":{\"h\":\"Pourquoi apprendre Titan ?\"},\"289\":{\"h\":\"Pour votre formation\",\"t\":[\"Architecture moderne : D√©couverte des patterns actuels du web et mobile\",\"Technologies populaires : Flutter, Riverpod sont des standards de l'industrie\",\"Bonnes pratiques : Code propre, tests, documentation\"]},\"290\":{\"h\":\"Pour l'√©cole\",\"t\":[\"Impact r√©el : Votre code sera utilis√© par tous les √©tudiants de Centrale\",\"Collaboration : Travail en √©quipe sur un vrai projet\",\"Responsabilit√© : Maintien d'un service critique pour l'√©cole\"]},\"291\":{\"h\":\"Pour votre avenir professionnel\",\"t\":[\"Exp√©rience concr√®te : Un vrai projet en production sur votre CV\",\"Stack moderne : Technologies utilis√©es dans l'industrie\",\"Architecture scalable : Patterns r√©utilisables dans d'autres projets\"]},\"292\":{\"h\":\"Prochaines √©tapes\",\"t\":[\"Maintenant que vous comprenez pourquoi Hyperion existe et ce qu'il fait, nous allons voir comment il fonctionne :\",\"Les 4 verbes fondamentaux - La base de toute API\",\"Configuration - Comment configurer Hyperion\",\"Premier lancement - Mise en route pratique\",\"Conseil\",\"N'h√©sitez pas √† poser des questions ! Les anciens de l'association sont l√† pour vous accompagner dans votre apprentissage.\"]},\"293\":{\"h\":\"Une architecture en miroir\",\"t\":[\"L'une des beaut√©s de Titan, c'est que tout repose sur la m√™me structure logique √† trois niveaux. Ces 4 verbes se retrouvent partout et facilitent √©norm√©ment la compr√©hension du syst√®me, comme pour Hyperion\"]},\"294\":{\"h\":\"Les 4 verbes HTTP\"},\"295\":{\"h\":\"GET - R√©cup√©rer des donn√©es\",\"t\":[\"Le verbe le plus simple : on demande des informations au serveur.\",\"GET /users/123 GET /events GET /groups/bde/members\",\"Caract√©ristiques :\",\"Idempotent : Peut √™tre appel√© plusieurs fois sans effet de bord\",\"Sans corps : Pas de donn√©es dans la requ√™te\",\"Cacheable : Le navigateur peut mettre en cache la r√©ponse\"]},\"296\":{\"h\":\"POST - Cr√©er des donn√©es\",\"t\":[\"Pour cr√©er de nouvelles ressources.\",\"POST /users Content-Type: application/json { \\\"username\\\": \\\"nouveau_etudiant\\\", \\\"email\\\": \\\"nouveau@ecl.ec-lyon.fr\\\" }\",\"Caract√©ristiques :\",\"Non-idempotent : Chaque appel cr√©e une nouvelle ressource\",\"Avec corps : Les donn√©es √† cr√©er sont dans le body\",\"Code 201 : \\\"Created\\\" en cas de succ√®s\"]},\"297\":{\"h\":\"PATCH - Modifier des donn√©es\",\"t\":[\"Pour mettre √† jour partiellement une ressource existante.\",\"PATCH /users/123 Content-Type: application/json { \\\"email\\\": \\\"nouvelle_adresse@ecl.ec-lyon.fr\\\" }\",\"Caract√©ristiques :\",\"Modification partielle : On envoie seulement les champs √† modifier\",\"Idempotent : M√™me r√©sultat si appel√© plusieurs fois\",\"Code 200 : \\\"OK\\\" en cas de succ√®s\"]},\"298\":{\"h\":\"DELETE - Supprimer des donn√©es\",\"t\":[\"Pour supprimer une ressource.\",\"DELETE /users/123\",\"Caract√©ristiques :\",\"Destructif : La ressource n'existe plus apr√®s\",\"Idempotent : Supprimer une ressource d√©j√† supprim√©e ne change rien\",\"Code 204 : \\\"No Content\\\" en cas de succ√®s\"]},\"299\":{\"h\":\"Les op√©rations Repository\",\"t\":[\"Un repository est un fichier qui s'occupe de toutes les interactions li√©s √† un route API, ex /bookings.\",\" Future<List<Booking>> getUserBookingList() async { return List<Booking>.from( (await getList(suffix: \\\"/users/me\\\")).map((x) => Booking.fromJson(x)), ); }\",\"R√©cup√®re une liste en json et la convertie en liste d'objet Booking\",\" Future<Booking> createBooking(Booking booking) async { return Booking.fromJson(await create(booking.toJson())); }\",\"Demande au back de cr√©er un booking et le retourne une fois cr√©√© (donc avec son id)\",\" Future<bool> updateBooking(Booking booking) async { return await update(booking.toJson(), \\\"/${booking.id}\\\"); }\",\"Demande au back de modifier un booking et le retourne une fois modifi√©\",\" Future<bool> deleteBooking(String bookingId) async { return await delete(\\\"/$bookingId\\\"); }\",\"Demande au back de supprimer un booking et retourne un bool√©en\",\"op√©rations get()\",\"Dans le cas o√π ne veux r√©cup√©rer qu'une seule donn√©e (donc pas une liste), on utilise get au lieu de getList\",\"param√®tres suffix\",\"Certaines requ√™te ont un path avec plus de param√®tre, que l'on peut pr√©ciser avec le suffixe\"]},\"300\":{\"h\":\"Les op√©ration Provider\",\"t\":[\"Future<AsyncValue<List<Booking>>> loadUserBookings() async { return await loadList(bookingRepository.getUserBookingList); }\",\"Charge la liste via le repository\",\" Future<bool> addBooking(Booking booking) async { return await add(bookingRepository.createBooking, booking); }\",\"Demande au repository de cr√©er un booking bas√© sur le booking donn√© en param√®tre\",\" Future<bool> updateBooking(Booking booking) async { return await update( bookingRepository.updateBooking, (bookings, booking) => bookings..[bookings.indexWhere((b) => b.id == booking.id)] = booking, booking, ); }\",\"Demande au repository de modifier un booking bas√© sur le booking donn√© en param√®tre et met √† jour dans la liste de l'√©tat interne\",\" Future<bool> deleteBooking(Booking booking) async { return await delete( bookingRepository.deleteBooking, (bookings, booking) => bookings..removeWhere((i) => i.id == booking.id), booking.id, booking, ); }\",\"Demande au repository de supprimer un booking bas√© sur le booking donn√© en param√®tre et met √† jour dans la liste de l'√©tat interne\",\"op√©rations load()\",\"Dans le cas o√π ne veux r√©cup√©rer qu'une seule donn√©e (donc pas une liste), on utilise load au lieu de loadList\"]},\"301\":{\"h\":\"La correspondance parfaite\",\"t\":[\"Voici comment ces trois niveaux se correspondent dans Hyperion :\",\"HTTP\",\"Repository\",\"Provider\",\"Objectif\",\"POST\",\"Create\",\"Add\",\"Cr√©er une nouvelle ressource\",\"GET\",\"Get\",\"Load\",\"R√©cup√©rer des donn√©es\",\"PATCH\",\"Update\",\"UPDATE\",\"Modifier une ressource existante\",\"DELETE\",\"Delete\",\"DELETE\",\"Supprimer une ressource\"]},\"302\":{\"h\":\"Codes de statut HTTP essentiels\"},\"303\":{\"h\":\"2xx - Succ√®s\",\"t\":[\"200 OK : Requ√™te r√©ussie (GET, PATCH)\",\"201 Created : Ressource cr√©√©e avec succ√®s (POST)\",\"204 No Content : Requ√™te r√©ussie sans contenu (DELETE)\"]},\"304\":{\"h\":\"4xx - Erreurs client\",\"t\":[\"400 Bad Request : Donn√©es malform√©es\",\"401 Unauthorized : Authentification requise\",\"403 Forbidden : Permissions insuffisantes\",\"404 Not Found : Ressource introuvable\",\"422 Unprocessable Entity : Validation √©chou√©e\"]},\"305\":{\"h\":\"5xx - Erreurs serveur\",\"t\":[\"500 Internal Server Error : Erreur interne du serveur\",\"Les erreurs sont g√©r√©es par les fonctions du repository, qui s'occupe de les logger. Le provider peut prendre un √©tat erreur, pour que le visuel puisse afficher le message d'erreur.\"]},\"306\":{\"c\":[\"Guide\"]},\"307\":{\"h\":\"SQLAlchemy\",\"t\":[\"Quelques notions suppl√©mentaires et utilitaires sur SQLAlchemy\"]},\"308\":{\"c\":[\"Guide\"]},\"309\":{\"h\":\"L'Asynchrone\"},\"310\":{\"h\":\"ü§î Le probl√®me du synchrone\",\"t\":[\"Dans une application web classique avec SQLAlchemy synchrone, chaque requ√™te HTTP bloque compl√®tement le thread pendant l'attente de la base de donn√©es :\"]},\"311\":{\"h\":\"‚ö° Les gains concrets\"},\"312\":{\"h\":\"üìä Performance\",\"t\":[\"Am√©lioration typique\",\"x10 √† x50 plus de requ√™tes simultan√©es\",\"-80% d'utilisation CPU pour les I/O\",\"-90% d'utilisation RAM (moins de threads)\",\"Latence r√©duite sous forte charge\"]},\"313\":{\"h\":\"üéØ Cas d'usage Hyperion\",\"t\":[\"Avant (synchrone) :\",\"50 utilisateurs qui consultent leurs √©v√©nements simultan√©ment ‚Üí 50 threads Python actifs ‚Üí Serveur surcharg√© √† 50 utilisateurs\",\"Apr√®s (asynchrone) :\",\"500 utilisateurs qui consultent leurs √©v√©nements simultan√©ment ‚Üí 1-2 threads Python actifs ‚Üí Serveur fluide m√™me √† 500 utilisateurs\"]},\"314\":{\"h\":\"üß† Principe simplifi√©\",\"t\":[\"L'asynchrone, c'est comme un serveur de restaurant efficace :\",\"::: code-group\",\"1. Prendre commande table 1 2. Aller en cuisine et ATTENDRE le plat ‚è∞ 3. Revenir avec le plat 4. Prendre commande table 2 5. Aller en cuisine et ATTENDRE le plat ‚è∞ ‚Üí 1 table servie toutes les 10 minutes\",\"1. Prendre commande table 1 2. Donner commande en cuisine (sans attendre) 3. Prendre commande table 2 4. Prendre commande table 3 5. R√©cup√©rer plat table 1 (pr√™t) 6. Continuer... ‚Üí 10 tables servies en 10 minutes\",\":::\"]},\"315\":{\"h\":\"üéØ Quand utiliser l'asynchrone ?\",\"t\":[\"Asynchrone recommand√© pour\",\"Applications web (FastAPI, Django Async)\",\"APIs REST avec beaucoup de trafic\",\"Microservices qui font des appels externes\",\"Applications avec I/O intensives (DB, fichiers, r√©seau)\",\"Asynchrone non n√©cessaire pour\",\"Scripts de batch simples\",\"Applications avec tr√®s peu d'utilisateurs (<10 simultan√©s)\",\"Calculs intensifs (CPU-bound)\"]},\"316\":{\"h\":\"üîÑ Migration en une phrase\",\"t\":[\"Remplacez session.query() par await db.execute(select()) et ajoutez async/await partout.\",\"R√©sultat : Votre application Hyperion peut servir 10x plus d'utilisateurs simultan√©s avec les m√™mes ressources serveur.\"]},\"317\":{\"c\":[\"Guide\",\"SQLAlchemy\"]},\"318\":{\"c\":[\"asynchrone\",\"performance\",\"base de donn√©es\"]},\"319\":{\"h\":\"Jointures\",\"t\":[\"Disclaimer\",\"Les noms, propri√©t√©s des mod√®les ne sont pas ceux d'Hyperion mais sont ici pr√©sents pour faciliter la compr√©hension. C'est donc √† vous d'adapter votre code en fonction de vos propres mod√®les.\"]},\"320\":{\"h\":\"Introduction\",\"t\":[\"Les jointures sont un concept fondamental lors du d√©veloppement de modules pour Hyperion. Elles permettent de r√©cup√©rer des donn√©es li√©es depuis plusieurs tables en optimisant les performances et en r√©duisant le nombre de requ√™tes SQL.\",\"Ce guide vous accompagnera dans la ma√Ætrise des jointures SQLAlchemy, depuis les concepts de base jusqu'aux techniques avanc√©es d'optimisation.\",\"Objectifs du guide\",\"Comprendre les diff√©rents types de jointures\",\"Apprendre √† optimiser les performances\",\"Ma√Ætriser la syntaxe SQLAlchemy\",\"√âviter les pi√®ges courants\"]},\"321\":{\"h\":\"Comprendre les jointures : explicites vs implicites\",\"t\":[\"Attention aux performances\",\"Les jointures peuvent rapidement devenir complexes et impacter les performances. Il est crucial de comprendre quand et comment les utiliser efficacement.\",\"SQLAlchemy offre deux approches pour g√©rer les relations entre entit√©s :\"]},\"322\":{\"h\":\"üîç Jointures explicites\"},\"323\":{\"h\":\"üîÑ Jointures implicites (Lazy Loading)\"},\"324\":{\"h\":\"üîç Jointures explicites\",\"t\":[\"Les jointures explicites effectuent une seule requ√™te SQL optimis√©e. C'est l'√©quivalent direct des jointures SQL classiques.\",\"Avantages :\",\"‚úÖ Une seule requ√™te SQL\",\"‚úÖ Performances optimales\",\"‚úÖ Contr√¥le total sur la requ√™te\"]},\"325\":{\"h\":\"üîÑ Jointures implicites (Lazy Loading)\",\"t\":[\"SQLAlchemy peut charger les donn√©es li√©es √† la demande, g√©n√©rant plusieurs requ√™tes SQL automatiquement.\",\"Avantages :\",\"‚úÖ Simplicit√© d'utilisation\",\"‚úÖ Charge uniquement les donn√©es n√©cessaires\",\"Inconv√©nients :\",\"‚ùå Probl√®me N+1 queries\",\"‚ùå Performances impr√©visibles\"]},\"326\":{\"h\":\"üéØ Matrice de d√©cision\",\"t\":[\"Le choix entre jointures explicites et implicites d√©pend de deux crit√®res principaux :\",\"Crit√®res de d√©cision\",\"Type de relation : One-to-one, One-to-many, Many-to-many\",\"Probabilit√© d'acc√®s : Acc√®s certain vs probable aux donn√©es li√©es\",\"Type de relation\",\"Acc√®s certain\",\"Acc√®s probable\",\"Recommandation\",\"One-to-one\",\"joinedload()\",\"selectinload()\",\"Toujours charger\",\"One-to-many\",\"selectinload()\",\"lazy='select'\",\"√âvaluer le cas\",\"Many-to-many\",\"selectinload()\",\"lazy='dynamic'\",\"Pagination recommand√©e\",\"Explication des strat√©gies de chargement\",\"joinedload() : Jointure SQL (LEFT JOIN)\",\"selectinload() : Requ√™te s√©par√©e avec IN\",\"lazy='select' : Chargement √† la demande (par d√©faut)\",\"lazy='dynamic' : Retourne une Query au lieu d'une liste\"]},\"327\":{\"h\":\"üîó Relations One-to-One\",\"t\":[\"Les relations one-to-one sont id√©ales pour √©tendre un mod√®le principal avec des donn√©es optionnelles.\",\"Exemple concret\",\"Un User peut avoir un seul Profile d√©taill√© avec photo, bio, etc.\"]},\"328\":{\"h\":\"D√©finition des mod√®les\",\"t\":[\"from sqlalchemy import ForeignKey, Text from sqlalchemy.orm import Mapped, mapped_column, relationship class CoreUser(Base): __tablename__ = \\\"core_user\\\" id: Mapped[str] = mapped_column(primary_key=True, index=True) username: Mapped[str] = mapped_column(index=True, unique=True) email: Mapped[str] = mapped_column(index=True, unique=True) # Relation one-to-one profile: Mapped[\\\"CoreUserProfile\\\"] = relationship( \\\"CoreUserProfile\\\", uselist=False, back_populates=\\\"user\\\" ) class CoreUserProfile(Base): __tablename__ = \\\"core_user_profile\\\" id: Mapped[str] = mapped_column(primary_key=True, index=True) user_id: Mapped[str] = mapped_column( ForeignKey(\\\"core_user.id\\\"), unique=True, index=True ) bio: Mapped[str | None] = mapped_column(Text) avatar_url: Mapped[str | None] user: Mapped[\\\"CoreUser\\\"] = relationship( \\\"CoreUser\\\", back_populates=\\\"profile\\\" )\"]},\"329\":{\"h\":\"Strat√©gies de chargement\",\"t\":[\"Bonne pratique\",\"Pour les relations one-to-one, utilisez toujours joinedload() car le co√ªt de la jointure est minimal et √©vite le probl√®me N+1.\"]},\"330\":{\"h\":\"üìö Relations One-to-Many\",\"t\":[\"Les relations one-to-many sont les plus courantes. Un parent peut avoir plusieurs enfants.\",\"Exemple concret\",\"Un CoreUser peut avoir plusieurs CoreAssociation (adh√©sions √† des associations).\"]},\"331\":{\"h\":\"D√©finition des mod√®les\",\"t\":[\"from sqlalchemy import Boolean, ForeignKey from sqlalchemy.orm import Mapped, mapped_column, relationship class CoreUser(Base): __tablename__ = \\\"core_user\\\" id: Mapped[str] = mapped_column(primary_key=True, index=True) username: Mapped[str] = mapped_column(index=True, unique=True) # Relation one-to-many associations: Mapped[list[\\\"CoreAssociation\\\"]] = relationship( \\\"CoreAssociation\\\", back_populates=\\\"user\\\", default_factory=list, ) class CoreAssociation(Base): __tablename__ = \\\"core_association\\\" id: Mapped[str] = mapped_column(primary_key=True, index=True) user_id: Mapped[str] = mapped_column(ForeignKey(\\\"core_user.id\\\"), index=True) name: Mapped[str] = mapped_column(index=True) is_active: Mapped[bool] = mapped_column(default=True) user: Mapped[\\\"CoreUser\\\"] = relationship( \\\"CoreUser\\\", back_populates=\\\"associations\\\" )\"]},\"332\":{\"h\":\"Strat√©gies selon le cas d'usage\",\"t\":[\"Attention au N+1\",\"# ‚ùå Probl√®me N+1 - √©vitez ceci ! async def bad_example(db: AsyncSession) -> None: result = await db.execute(select(CoreUser)) users = result.scalars().all() # 1 requ√™te for user in users: print(len(user.associations)) # N requ√™tes suppl√©mentaires ! # ‚úÖ Solution avec selectinload async def good_example(db: AsyncSession) -> None: result = await db.execute( select(CoreUser).options(selectinload(CoreUser.associations)) ) users = result.scalars().all() for user in users: print(len(user.associations)) # Pas de requ√™te suppl√©mentaire\"]},\"333\":{\"h\":\"üîÄ Relations Many-to-Many\",\"t\":[\"Les relations many-to-many n√©cessitent une table d'association et demandent une attention particuli√®re.\",\"Exemple concret\",\"Un CoreUser peut appartenir √† plusieurs CoreGroup, et un CoreGroup peut contenir plusieurs CoreUser.\"]},\"334\":{\"h\":\"D√©finition des mod√®les\",\"t\":[\"from sqlalchemy import Table, ForeignKey from sqlalchemy.orm import Mapped, mapped_column, relationship # Table d'association core_membership = Table( \\\"core_membership\\\", Base.metadata, mapped_column(\\\"user_id\\\", ForeignKey(\\\"core_user.id\\\"), primary_key=True), mapped_column(\\\"group_id\\\", ForeignKey(\\\"core_group.id\\\"), primary_key=True), ) class CoreUser(Base): __tablename__ = \\\"core_user\\\" id: Mapped[str] = mapped_column(primary_key=True, index=True) username: Mapped[str] = mapped_column(index=True, unique=True) # Relation many-to-many groups: Mapped[list[\\\"CoreGroup\\\"]] = relationship( \\\"CoreGroup\\\", secondary=\\\"core_membership\\\", back_populates=\\\"members\\\", default_factory=list, ) class CoreGroup(Base): __tablename__ = \\\"core_group\\\" id: Mapped[str] = mapped_column(primary_key=True, index=True) name: Mapped[str] = mapped_column(index=True, unique=True) description: Mapped[str | None] members: Mapped[list[\\\"CoreUser\\\"]] = relationship( \\\"CoreUser\\\", secondary=\\\"core_membership\\\", back_populates=\\\"groups\\\", default_factory=list, )\"]},\"335\":{\"h\":\"Strat√©gies de chargement optimis√©es\",\"t\":[\"Optimisation many-to-many\",\"Utilisez lazy='dynamic' pour de grandes collections\",\"Consid√©rez l'Association Object Pattern pour les m√©tadonn√©es\",\"Toujours paginer les r√©sultats en production\"]},\"336\":{\"h\":\"üöÄ Techniques avanc√©es et bonnes pratiques\"},\"337\":{\"h\":\"Combinaison de strat√©gies\"},\"338\":{\"h\":\"Debugging et monitoring\",\"t\":[\"Debugging et profiling\",\"Logger SQL\",\"import logging # Activer les logs SQL pour d√©bugger (√† configurer dans settings) logging.basicConfig() logging.getLogger('sqlalchemy.engine').setLevel(logging.INFO) # En d√©veloppement, vous pouvez aussi utiliser : # SQLALCHEMY_ECHO=True dans votre configuration\",\"Middleware de monitoring\",\"from fastapi import Request from sqlalchemy import event import time class SQLMonitoringMiddleware: def __init__(self): self.query_count = 0 self.total_time = 0 def setup_monitoring(self, engine): @event.listens_for(engine, \\\"before_cursor_execute\\\") def before_cursor_execute(conn, cursor, statement, parameters, context, executemany): context._query_start_time = time.time() self.query_count += 1 @event.listens_for(engine, \\\"after_cursor_execute\\\") def after_cursor_execute(conn, cursor, statement, parameters, context, executemany): total = time.time() - context._query_start_time self.total_time += total print(f\\\"Query #{self.query_count}: {total:.3f}s\\\") # Usage monitoring = SQLMonitoringMiddleware() monitoring.setup_monitoring(engine)\"]},\"339\":{\"h\":\"Patterns d'optimisation\",\"t\":[\"Repository Pattern avec chargement optimis√©\",\"from sqlalchemy.ext.asyncio import AsyncSession from sqlalchemy import select from sqlalchemy.orm import selectinload, joinedload, load_only class CoreUserRepository: def __init__(self, db: AsyncSession): self.db = db async def get_by_id(self, user_id: str) -> CoreUser | None: \\\"\\\"\\\"R√©cup√©ration basique d'un utilisateur\\\"\\\"\\\" result = await self.db.execute( select(CoreUser).where(CoreUser.id == user_id) ) return result.scalars().first() async def get_with_groups(self, user_id: str) -> CoreUser | None: \\\"\\\"\\\"Utilisateur avec ses groupes\\\"\\\"\\\" result = await self.db.execute( select(CoreUser) .where(CoreUser.id == user_id) .options(selectinload(CoreUser.groups)) ) return result.scalars().first() async def get_with_full_profile(self, user_id: str) -> CoreUser | None: \\\"\\\"\\\"Utilisateur avec profil complet (one-to-one)\\\"\\\"\\\" result = await self.db.execute( select(CoreUser) .where(CoreUser.id == user_id) .options(joinedload(CoreUser.profile)) ) return result.scalars().first() async def list_summary( self, limit: int = 50, offset: int = 0 ) -> list[CoreUser]: \\\"\\\"\\\"Liste optimis√©e pour l'affichage\\\"\\\"\\\" result = await self.db.execute( select(CoreUser) .options( load_only(CoreUser.id, CoreUser.username, CoreUser.email), joinedload(CoreUser.profile).load_only(CoreUserProfile.avatar_url) ) .limit(limit) .offset(offset) ) return result.scalars().all() async def search_with_associations( self, search_term: str ) -> list[CoreUser]: \\\"\\\"\\\"Recherche avec associations pr√©-charg√©es\\\"\\\"\\\" result = await self.db.execute( select(CoreUser) .where(CoreUser.username.ilike(f\\\"%{search_term}%\\\")) .options( selectinload(CoreUser.associations), selectinload(CoreUser.groups) ) ) return result.scalars().all()\",\"Anti-patterns √† √©viter\",\"# ‚ùå Chargement en boucle async def bad_pattern(db: AsyncSession, user_ids: list[str]) -> None: for user_id in user_ids: result = await db.execute( select(CoreUser).where(CoreUser.id == user_id) ) user = result.scalars().first() await process_user(user) # ‚úÖ Chargement en lot async def good_pattern(db: AsyncSession, user_ids: list[str]) -> None: result = await db.execute( select(CoreUser).where(CoreUser.id.in_(user_ids)) ) users = result.scalars().all() for user in users: await process_user(user) # ‚ùå Acc√®s aux relations sans pr√©chargement async def bad_lazy_access(db: AsyncSession) -> None: result = await db.execute(select(CoreUser)) users = result.scalars().all() for user in users: print(f\\\"User {user.username} has {len(user.groups)} groups\\\") # N+1 ! # ‚úÖ Pr√©chargement appropri√© async def good_eager_loading(db: AsyncSession) -> None: result = await db.execute( select(CoreUser).options(selectinload(CoreUser.groups)) ) users = result.scalars().all() for user in users: print(f\\\"User {user.username} has {len(user.groups)} groups\\\") # OK !\"]},\"340\":{\"h\":\"üìã Checklist des bonnes pratiques\",\"t\":[\"Checklist performance\",\"Identifiez vos patterns d'acc√®s avant de choisir la strat√©gie\",\"Utilisez selectinload() pour les relations one-to-many mod√©r√©es\",\"Utilisez joinedload() pour les relations one-to-one\",\"Paginez les relations many-to-many volumineuses\",\"Activez les logs SQL en d√©veloppement pour d√©bugger\",\"Mesurez les performances avec des outils de profiling\",\"√âvitez les boucles avec chargement lazy\",\"Utilisez load_only() pour limiter les colonnes charg√©es\",\"Points d'attention\",\"Les jointures peuvent exploser la taille des r√©sultats\",\"Le lazy loading peut cr√©er des probl√®mes N+1\",\"Les relations many-to-many n√©cessitent une pagination\",\"Testez toujours avec des donn√©es r√©alistes\"]},\"341\":{\"c\":[\"Guide\",\"SQLAlchemy\"]},\"342\":{\"c\":[\"jointures\",\"performance\",\"base de donn√©es\"]},\"343\":{\"h\":\"Migrations Alembic\"},\"344\":{\"h\":\"Introduction\",\"t\":[\"Les migrations sont essentielles pour g√©rer l'√©volution du sch√©ma de base de donn√©es dans Hyperion. Elles permettent de synchroniser les modifications des mod√®les SQLAlchemy avec la structure de la base de donn√©es de mani√®re contr√¥l√©e et versionn√©e.\",\"Ce guide vous accompagnera dans la ma√Ætrise d'Alembic, l'outil de migration de r√©f√©rence pour SQLAlchemy.\",\"Objectifs du guide\",\"Comprendre le fonctionnement des migrations Alembic\",\"Ma√Ætriser les commandes essentielles\",\"Appliquer les bonnes pratiques\",\"R√©soudre les probl√®mes courants\",\"Fonctionnement d'Alembic\",\"Alembic g√©n√®re des fichiers de migration en comparant vos mod√®les SQLAlchemy avec l'√©tat actuel de la base de donn√©es. Ces migrations sont ensuite appliqu√©es s√©quentiellement pour maintenir la coh√©rence du sch√©ma.\"]},\"345\":{\"h\":\"üöÄ D√©marrage rapide\",\"t\":[\"# G√©n√®re automatiquement une migration bas√©e sur les changements des mod√®les alembic revision --autogenerate -m \\\"Ajouter table CoreEvent\\\"\",\"# Applique toutes les migrations en attente alembic upgrade head\",\"# Affiche la migration courante alembic current\"]},\"346\":{\"h\":\"üìö Commandes Alembic essentielles\"},\"347\":{\"h\":\"üîÑ Ex√©cution des migrations\",\"t\":[\"Dans Hyperion, les migrations sont automatiquement ex√©cut√©es au d√©marrage de l'application. Cependant, vous pouvez les lancer manuellement :\",\"# Applique toutes les migrations jusqu'√† la derni√®re alembic upgrade head\",\"# Applique les migrations jusqu'√† une r√©vision sp√©cifique alembic upgrade ae1027a6acf\",\"# Applique les 2 prochaines migrations alembic upgrade +2\",\"# Revient √† la migration pr√©c√©dente alembic downgrade -1\",\"Attention en production\",\"Les migrations vers le bas (downgrade) peuvent entra√Æner une perte de donn√©es. Testez toujours sur un environnement de d√©veloppement avant !\"]},\"348\":{\"h\":\"üìù Cr√©ation de migrations\",\"t\":[\"Convention de nommage\",\"Utilisez des messages descriptifs et en fran√ßais : \\\"Ajouter table CoreEvent\\\", \\\"Modifier contrainte unique sur username\\\", etc.\"]},\"349\":{\"h\":\"üîç Inspection et historique\",\"t\":[\"# Affiche la r√©vision actuelle de la base de donn√©es alembic current\",\"# Liste toutes les migrations avec leur statut alembic history --verbose\",\"# Affiche les migrations qui ne sont pas encore appliqu√©es alembic heads\",\"# Montre les d√©tails d'une migration sp√©cifique alembic show ae1027a6acf\"]},\"350\":{\"h\":\"üõ†Ô∏è Commandes de maintenance\",\"t\":[\"# Force Alembic √† consid√©rer la DB √† jour (sans ex√©cuter les migrations) alembic stamp head\",\"# Supprime les r√©f√©rences √† des migrations inexistantes alembic stamp --purge head\",\"# V√©rifie la coh√©rence de l'historique des migrations alembic check\",\"Commandes dangereuses\",\"stamp et stamp --purge modifient l'√©tat d'Alembic sans appliquer les changements r√©els. Utilisez uniquement en cas de probl√®me et apr√®s backup !\"]},\"351\":{\"h\":\"üìã Bonnes pratiques\"},\"352\":{\"h\":\"‚úÖ Workflow recommand√©\",\"t\":[\"Processus de migration standard\",\"Modifiez vos mod√®les SQLAlchemy\",\"G√©n√©rez la migration avec alembic revision --autogenerate\",\"Reviewez le fichier g√©n√©r√© avant de l'appliquer\",\"Testez sur un environnement de d√©veloppement\",\"Appliquez en production avec prudence\"]},\"353\":{\"h\":\"üéØ R√®gles d'or\",\"t\":[\"Details\",\"Compatibilit√© SQLite Pour que les migrations soient compatibles avec SQLite, les commandes alter doivent √™tre encapsul√©es dans un contexte batch_alter_table :\",\"# ‚úÖ Compatible SQLite with op.batch_alter_table(\\\"core_user\\\") as batch_op: batch_op.add_column(sa.Column('new_field', sa.String(50))) # ‚ùå Incompatible SQLite op.add_column('core_user', sa.Column('new_field', sa.String(50)))\",\"Convention de nommage\",\"Les fichiers de migration suivent la convention : {r√©vision}_{message}.py\",\"Exemples de bons messages :\",\"\\\"ajouter_table_core_event\\\"\",\"\\\"modifier_contrainte_unique_username\\\"\",\"\\\"supprimer_colonne_deprecated_field\\\"\",\"√Ä √©viter :\",\"Messages trop vagues : \\\"update\\\", \\\"fix\\\"\",\"Messages en anglais inconsistants\",\"Messages sans contexte\"]},\"354\":{\"h\":\"üîß R√©vision syst√©matique\",\"t\":[\"Toujours r√©viser les migrations auto-g√©n√©r√©es\",\"Alembic peut parfois g√©n√©rer des migrations incorrectes ou incompl√®tes. V√©rifiez syst√©matiquement :\",\"Les suppressions de colonnes ne sont pas des renommages\",\"Les types de donn√©es sont corrects\",\"Les contraintes sont bien d√©finies\",\"L'ordre des op√©rations est logique\"]},\"355\":{\"h\":\"üíæ Migrations de donn√©es\"},\"356\":{\"h\":\"üèóÔ∏è Gestion des environnements\",\"t\":[\"Strat√©gie multi-environnements\",\"D√©veloppement :\",\"# Auto-g√©n√©ration fr√©quente pour tester alembic revision --autogenerate -m \\\"test_feature_xyz\\\"\",\"Staging :\",\"# Test des migrations avant production alembic upgrade head alembic history # V√©rifier l'√©tat\",\"Production :\",\"# Backup avant migration ! pg_dump hyperion_prod > backup_$(date +%Y%m%d_%H%M%S).sql # Migration avec logging alembic upgrade head --verbose\"]},\"357\":{\"h\":\"üõ°Ô∏è Migrations s√ªres\",\"t\":[\"Changements sans risque vs. risqu√©s\",\"‚úÖ Changements s√ªrs :\",\"Ajouter une colonne nullable\",\"Ajouter un index\",\"Ajouter une table\",\"Ajouter une contrainte de validation (avec NOT VALID)\",\"‚ö†Ô∏è Changements risqu√©s :\",\"Supprimer une colonne\",\"Modifier le type d'une colonne\",\"Ajouter une contrainte NOT NULL\",\"Renommer une table/colonne\",\"üîí Pour les changements risqu√©s :\",\"D√©ploiement en 2 √©tapes (ajout + suppression s√©par√©s)\",\"Fen√™tre de maintenance planifi√©e\",\"Rollback plan test√©\",\"Monitoring accru post-d√©ploiement\"]},\"358\":{\"h\":\"üß© Exemples de migrations courantes\"},\"359\":{\"h\":\"üè∑Ô∏è Gestion des Enums\"},\"360\":{\"h\":\"üèóÔ∏è Modifications de structure\"},\"361\":{\"h\":\"üîó Relations et cl√©s √©trang√®res\"},\"362\":{\"h\":\"üìä Index et performance\",\"t\":[\"\\\"\\\"\\\"Optimiser les requ√™tes fr√©quentes Revision ID: add_indexes_001 \\\"\\\"\\\" def upgrade(): # Index simple pour les recherches op.create_index( 'idx_core_user_username', 'core_user', ['username'] ) # Index composite pour les requ√™tes filtr√©es op.create_index( 'idx_core_event_date_status', 'core_event', ['event_date', 'status'] ) # Index partiel (PostgreSQL seulement) if op.get_context().dialect.name == 'postgresql': op.execute(\\\"\\\"\\\" CREATE INDEX idx_core_user_active ON core_user (created_at) WHERE is_active = true \\\"\\\"\\\") def downgrade(): op.drop_index('idx_core_user_username') op.drop_index('idx_core_event_date_status') if op.get_context().dialect.name == 'postgresql': op.execute(\\\"DROP INDEX IF EXISTS idx_core_user_active\\\")\"]},\"363\":{\"h\":\"üõ†Ô∏è Valeurs par d√©faut et contraintes\",\"t\":[\"\\\"\\\"\\\"Ajouter des valeurs par d√©faut c√¥t√© serveur Revision ID: server_defaults_001 \\\"\\\"\\\" def upgrade(): with op.batch_alter_table(\\\"core_user\\\") as batch_op: # Boolean avec d√©faut serveur batch_op.add_column( sa.Column( 'is_active', sa.Boolean(), server_default=sa.sql.true(), # ‚úÖ Correct pour SQLAlchemy nullable=False ) ) # DateTime avec d√©faut serveur batch_op.add_column( sa.Column( 'last_login', sa.DateTime(), server_default=sa.func.now(), nullable=True ) ) # UUID avec d√©faut serveur (PostgreSQL) if op.get_context().dialect.name == 'postgresql': batch_op.add_column( sa.Column( 'uuid', sa.String(), server_default=sa.text('gen_random_uuid()'), nullable=False ) ) def downgrade(): with op.batch_alter_table(\\\"core_user\\\") as batch_op: batch_op.drop_column('is_active') batch_op.drop_column('last_login') if op.get_context().dialect.name == 'postgresql': batch_op.drop_column('uuid')\"]},\"364\":{\"h\":\"üö® R√©solution de probl√®mes\"},\"365\":{\"h\":\"‚ùå Erreurs courantes et solutions\",\"t\":[\"Migration qui √©choue en cours d'ex√©cution\",\"Probl√®me :sqlalchemy.exc.IntegrityError: constraint failed\",\"Causes possibles :\",\"Contrainte NOT NULL sur une colonne avec des valeurs NULL existantes\",\"Contrainte UNIQUE viol√©e par des donn√©es existantes\",\"Cl√© √©trang√®re pointant vers un enregistrement inexistant\",\"Solutions :\",\"def upgrade(): # ‚ùå √âchoue si des donn√©es existent op.add_column('core_user', sa.Column('email', sa.String(), nullable=False)) # ‚úÖ Solution en 2 √©tapes # 1. Ajouter la colonne nullable op.add_column('core_user', sa.Column('email', sa.String(), nullable=True)) # 2. Remplir les donn√©es manquantes connection = op.get_bind() connection.execute( sa.text(\\\"UPDATE core_user SET email = username || '@temp.local' WHERE email IS NULL\\\") ) # 3. Appliquer la contrainte NOT NULL with op.batch_alter_table(\\\"core_user\\\") as batch_op: batch_op.alter_column('email', nullable=False)\",\"√âtat de migration incoh√©rent\",\"Probl√®me :FAILED: Target database is not up to date\",\"Diagnostic :\",\"# V√©rifier l'√©tat actuel alembic current alembic history --verbose # Voir les migrations en attente alembic heads\",\"Solutions :\",\"# Solution 1 : Appliquer les migrations manquantes alembic upgrade head # Solution 2 : Si la DB est d√©j√† √† jour mais Alembic ne le sait pas alembic stamp head # Solution 3 : En cas de corruption de l'historique alembic stamp --purge head\",\"Conflits de fusion de branches\",\"Probl√®me :Multiple heads detected\",\"Diagnostic :\",\"alembic heads # Montre plusieurs t√™tes\",\"Solution :\",\"# 1. Cr√©er une migration de fusion alembic merge -m \\\"Fusionner branches feature-A et feature-B\\\" head1 head2 # 2. Ou utiliser les d√©pendances lors de la cr√©ation alembic revision --depends-on head1,head2 -m \\\"Migration apr√®s fusion\\\"\"]},\"366\":{\"h\":\"üîÑ Migrations complexes\",\"t\":[\"Migration z√©ro-downtime\",\"Pour les applications critiques, certaines migrations doivent √™tre d√©ploy√©es sans interruption :\",\"√âtape 1 : Pr√©paration\",\"\\\"\\\"\\\"Phase 1: Ajouter nouvelle colonne Revision ID: zero_downtime_001 \\\"\\\"\\\" def upgrade(): # Ajouter la nouvelle colonne nullable with op.batch_alter_table(\\\"core_user\\\") as batch_op: batch_op.add_column(sa.Column('new_field', sa.String(100), nullable=True)) # Pas de modification du code applicatif encore def downgrade(): with op.batch_alter_table(\\\"core_user\\\") as batch_op: batch_op.drop_column('new_field')\",\"√âtape 2 : D√©ploiement applicatif\",\"D√©ployer le code qui √©crit dans les deux colonnes (ancienne + nouvelle)\",\"Les lectures se font encore sur l'ancienne colonne\",\"√âtape 3 : Migration des donn√©es\",\"\\\"\\\"\\\"Phase 2: Migrer les donn√©es existantes Revision ID: zero_downtime_002 \\\"\\\"\\\" def upgrade(): # Migrer toutes les donn√©es existantes connection = op.get_bind() connection.execute( sa.text(\\\"UPDATE core_user SET new_field = old_field WHERE new_field IS NULL\\\") ) def downgrade(): pass # Les donn√©es peuvent √™tre re-migr√©es √† partir de old_field\",\"√âtape 4 : Finalisation\",\"\\\"\\\"\\\"Phase 3: Finaliser la migration Revision ID: zero_downtime_003 \\\"\\\"\\\" def upgrade(): # Rendre la nouvelle colonne NOT NULL with op.batch_alter_table(\\\"core_user\\\") as batch_op: batch_op.alter_column('new_field', nullable=False) # Optionnel : supprimer l'ancienne colonne # batch_op.drop_column('old_field') def downgrade(): with op.batch_alter_table(\\\"core_user\\\") as batch_op: batch_op.alter_column('new_field', nullable=True) # Recr√©er old_field si supprim√©e\",\"Migration de grandes tables\",\"Pour les tables avec des millions d'enregistrements :\",\"\\\"\\\"\\\"Migration par batch pour grande table Revision ID: large_table_001 \\\"\\\"\\\" def upgrade(): connection = op.get_bind() # Migration par batch de 10 000 enregistrements batch_size = 10000 offset = 0 while True: result = connection.execute( sa.text(f\\\"\\\"\\\" UPDATE core_user SET processed = true WHERE id IN ( SELECT id FROM core_user WHERE processed IS NULL LIMIT {batch_size} ) \\\"\\\"\\\") ) if result.rowcount == 0: break print(f\\\"Trait√© {offset + result.rowcount} enregistrements\\\") offset += result.rowcount # Commit interm√©diaire pour √©viter les verrous longs connection.commit() def downgrade(): connection = op.get_bind() connection.execute(sa.text(\\\"UPDATE core_user SET processed = NULL\\\"))\"]},\"367\":{\"h\":\"üõ†Ô∏è Outils de debugging\",\"t\":[\"Mode verbose et logging\",\"# Dans votre migration, ajoutez du logging import logging logger = logging.getLogger(__name__) def upgrade(): logger.info(\\\"D√©but de la migration complexe\\\") connection = op.get_bind() # Compter les enregistrements avant result = connection.execute(sa.text(\\\"SELECT COUNT(*) FROM core_user\\\")) count_before = result.scalar() logger.info(f\\\"Enregistrements avant migration: {count_before}\\\") # Votre migration... # Compter apr√®s result = connection.execute(sa.text(\\\"SELECT COUNT(*) FROM core_user WHERE email IS NOT NULL\\\")) count_after = result.scalar() logger.info(f\\\"Enregistrements avec email apr√®s migration: {count_after}\\\")\",\"Commandes de debug :\",\"# Mode verbose alembic upgrade head --verbose # Voir le SQL g√©n√©r√© sans l'ex√©cuter alembic upgrade head --sql # Cr√©er une migration avec du SQL personnalis√© alembic upgrade head --tag \\\"production-deployment-2024-01\\\"\"]},\"368\":{\"h\":\"üéØ Checklist pr√©-production\",\"t\":[\"Checklist de d√©ploiement\",\"Backup complet de la base de donn√©es\",\"Test sur un clone de la base de production\",\"Validation des donn√©es apr√®s migration\",\"Plan de rollback document√© et test√©\",\"Fen√™tre de maintenance planifi√©e si n√©cessaire\",\"Monitoring renforc√© post-d√©ploiement\",\"Communication aux √©quipes concern√©es\",\"Points critiques\",\"Jamais de migration destructive sans backup\",\"Tester le rollback avant le d√©ploiement\",\"Pr√©voir du temps suppl√©mentaire pour les grandes tables\",\"Surveiller les performances apr√®s d√©ploiement\",\"En cas de probl√®me en production\",\"STOP : Arr√™ter imm√©diatement si possible\",\"√âVALUER : Analyser l'impact et les risques\",\"ROLLBACK : Utiliser le plan de retour en arri√®re\",\"RESTAURER : Depuis le backup si n√©cessaire\",\"POST-MORTEM : Analyser les causes apr√®s r√©solution\"]},\"369\":{\"h\":\"üìö Ressources et r√©f√©rences\",\"t\":[\"Liens utiles\",\"Documentation Alembic officielle\",\"Guide des migrations SQLAlchemy\",\"Batch operations pour SQLite\",\"Migration patterns avanc√©s\",\"Commandes de r√©f√©rence rapide\",\"# Cr√©er une migration alembic revision --autogenerate -m \\\"Description\\\" # Appliquer les migrations alembic upgrade head # Voir l'√©tat alembic current # Historique complet alembic history --verbose # Rollback d'une migration alembic downgrade -1 # Marquer comme appliqu√© alembic stamp head\"]},\"370\":{\"c\":[\"Guide\",\"SQLAlchemy\"]},\"371\":{\"c\":[\"migrations\",\"alembic\",\"base de donn√©es\",\"sch√©ma\"]},\"372\":{\"h\":\"Builder Custom\"},\"373\":{\"c\":[\"Guide\"]},\"374\":{\"h\":\"AsyncChild\"},\"375\":{\"h\":\"AsyncChild\",\"t\":[\"Description : Ce Widget permet de g√©rer les AsyncValue, en g√©rant les trois valeurs possibles. Par d√©faut, un AsyncLoading sera rendu par un Loader et un AsyncError par un Text affichant l'erreur, mais tout est customisable.\",\"Utilisation :\",\"Utilisation assez fr√©quente (72 fois). Ce Widget sert d√®s qu'il y a un AsyncValue dont la valeur fait directement changer les widgets √† afficher.\",\"Param√®tres :\",\"value (AsyncValue<T>)obligatoire : L'asyncValue dont on veux rendre le contenu\",\"builder (Widget Function(BuildContext context, T value))obligatoire : Le builder qui prend en entr√©e le contexte et la valeur de l'AsyncData et qui doit retourner un Widget.\",\"errorBuilder (Widget Function(Object? error, StackTrace? stack))optionel : Le builder de l'erreur, √† ne donner que si le Text avec l'erreur ne convient pas.\",\"loadingBuilder (Widget Function(BuildContext context))optionel : Le builder du loading, √† ne donner que si le Loader ne convient pas.\",\"orElseBuilder (Widget Function(BuildContext context, Widget child))optionel : Le builder de l'erreur et du loading, le child est soit l'errorBuilder, s'il est donn√©, soit le Text dans le cas de l'erreur, soit le loadingBuilder, s'il est donn√©, soit le Loader. Ce builder permet d'avoir un style pour ces deux options, dans le cas o√π les data doivent prendrer une toutes autres formes (Ex: Une colonne pour les donn√©es et juste un SizedBox pour loading et error)\",\"loaderColor (Color)optionel : La couleur du loader et du texte.\",\"Exemple :cash_container.dart\",\"final cash = ref.watch(cashProvider); return AsyncChild( value: cash, builder: (context, cash) => Row(children: cash.map((e) => UserCashUi(cash: e)).toList()), loaderColor: AMAPColorConstants.greenGradient2);\"]},\"376\":{\"c\":[\"Guide\"]},\"377\":{\"h\":\"AutoLoaderChild\"},\"378\":{\"h\":\"AutoLoaderChild\",\"t\":[\"Description :\",\"Ce Widget permet de charger une donn√©e qui sera ajout√©e √† un MapNotifier, tout en affichant quelque chose pendant l'attente. Il faut s'en servir d√®s que les conditions suivantes sont v√©rifi√©es :\",\"Il faut un MapNotifier\",\"On veux l'approvisionner\",\"On veux afficher quelque chose quelque soit l'√©tat du MapNotifier Ex: la gestion des logos des pr√©tendances du modules de vote, on ne les charges qui si l'utilisateurs peut les voir.\",\"Utilisation :\",\"Utilisation assez rare (10 fois). Ce Widget est con√ßus pour un cas d'usage tr√©s pr√©cis, mais il permet d'abstraire toutes la logique et d'√©viter les cas d'erreurs qui ont √©t√©s tr√®s compliqu√©es √† trouver et r√©soudre.\",\"Param√®tres :\",\"value (AsyncValue<Map<MapKey, AsyncValue<List<MapValue>>>>)obligatoire : Le MapNotifier dont on veux utiliser les donn√©es pour de l'affichage.\",\"notifier (MapNotifier<MapKey, MapValue>)obligatoire : Le notifier de value\",\"mapKey (MapKey)obligatoire : La cl√©e de la valeur que l'on veux afficher\",\"loader (Future<MapValue> Function(MapKey t))obligatoire si listLoader n'es pas donn√© : la fonction √† appeler pour charge la donn√©e manquante (typiquement l'appel √† un SimpleNotifier)\",\"listLoader (Future<AsyncValue<List<MapValue>>> Function(MapKey t))obligatoire si loader n'est pas donn√©: la fonction √† appeler pour charge la donn√©e manquante (typiquement l'appel √† un ListNotifier)\",\"dataBuilder Widget Function(BuildContext context, MapValue value))obligatoire : Le builder qui prend en entr√©e le contexte et la valeur de la map associ√©e √† mapKey et qui doit retourner un Widget.\",\"errorBuilder (Widget Function(Object? error, StackTrace? stack))optionel : Le builder de l'erreur, √† ne donner que si le Text avec l'erreur ne convient pas.\",\"loadingBuilder (Widget Function(BuildContext context))optionel : Le builder du loading, √† ne donner que si le Loader ne convient pas.\",\"orElseBuilder (Widget Function(BuildContext context, Widget child))optionel : Le builder de l'erreur et du loading, le child est soit l'errorBuilder, s'il est donn√©, soit le Text dans le cas de l'erreur, soit le loadingBuilder, s'il est donn√©, soit le Loader. Ce builder permet d'avoir un style pour ces deux options, dans le cas o√π les data doivent prendrer une toutes autres formes (Ex: Une colonne pour les donn√©es et juste un SizedBox pour loading et error)\",\"loaderColor (Color)optionel : La couleur du loader et du texte.\",\"Exemple :contender_logo.dart\",\"final contenderLogos = ref.watch(contenderLogosProvider); final contenderLogosNotifier = ref.read(contenderLogosProvider.notifier); final logoNotifier = ref.read(contenderLogoProvider.notifier); return AutoLoaderChild( value: contenderLogos, notifier: contenderLogosNotifier, mapKey: contender, loader: (contender) => logoNotifier.getLogo(contender.id), dataBuilder: (context, logo) => Container( decoration: BoxDecoration( shape: BoxShape.circle, image: DecorationImage( image: logo.image, fit: BoxFit.cover, ), ), ), );\"]},\"379\":{\"c\":[\"Guide\"]},\"380\":{\"h\":\"Customs Builders\"},\"381\":{\"h\":\"Les Builders\",\"t\":[\"Les Builders sont des Widgets qui se contruisent √† partir de fonction qui prend plusieurs param√®tres et qui retourne des Widgets enfants. Les enfants de ces Widgets peuvent donc influer sur le comportement des Widgets parents.\"]},\"382\":{\"c\":[\"Guide\"]},\"383\":{\"h\":\"AsyncChild\"},\"384\":{\"h\":\"WaitingButton\",\"t\":[\"Descr√¨ption : Il a √©t√© design√© pour g√©rer l'attente de la r√©ponse de l'API. Au clic, il r√©tr√©cie, affiche un Loader et n'est pas cliquable tant qu'il n'y a pas eu de r√©ponse.\",\"Utilisation :\",\"Utilisation tr√®s fr√©quente (54 fois). Ce Widget est un bouton qui doit √™tre utilis√© quand la fonction qu'il appele contient un appel √† l'API.\",\"Param√®tres :\",\"`child (Widget) obligatoire : Ce qui doit √™tre dans le bouton (typiquement un Text ou un Icon)\",\"builder (Widget Function(Widget)) obligatoire : Le visuel du bouton (typiquement un AddEditButtonLayout) final Color waitingColor; final Future Function()? onTap;\",\"Exemple :association_ui.dart\",\"WaitingButton( onTap: onDelete, builder: (child) => AssociationButton( gradient1: ColorConstants.gradient1, gradient2: ColorConstants.gradient2, child: child, ), child: const HeroIcon( HeroIcons.xMark, color: Colors.white, ), ),\",\"Info : OnDelete est un fonction d√©finie plus haut, et AssociationButton est un Widget sp√©cifique au module\"]},\"385\":{\"c\":[\"Guide\"]},\"386\":{\"h\":\"Builder Layouts\"},\"387\":{\"c\":[\"Guide\"]},\"388\":{\"h\":\"AddEditButtonLayout\"},\"389\":{\"h\":\"AddEditButtonLayout\",\"t\":[\"Description :\",\"Ce bouton permet d'uniformiser l'apparence des boutons de confirmation d'ajout et d'√©dition d'un objet. La forme est fixe, mais la couleur peut changer.\",\"Utilisation :\",\"Utilisation assez rare (14 fois). Ce bouton est √† utliser dans les page d'ajout et d'√©dition d'objet, en le passant comme builder d'un WaitingButton.\",\"Param√®tres :\",\"child (Widget)obligatoire : Le contenu du bouton (Ex: un Text)\",\"color (Color)optionel : La couleur de fond du bouton (Par d√©faut, noir)\",\"colors (Color)optionel : Si donn√©, le fond du bouton sera un gradient avec colors comme couleur.\",\"Exemple :add_edit_product.dart\",\"AddEditButtonLayout( color: AMAPColorConstants.greenGradient1, gradient: AMAPColorConstants.greenGradient2, child: child)\"]},\"390\":{\"c\":[\"Guide\"]},\"391\":{\"h\":\"CardButton\"},\"392\":{\"h\":\"CardButton\",\"t\":[\"Description :\",\"Ce bouton permet d'uniformiser l'apparence des boutons d'ajout, d'√©dition de suppression d'un objet, ou de toutes autres actions dans une carte. La forme est fixe, mais la couleur peut changer.\",\"Utilisation :\",\"Utilisation fr√©quente (37 fois). Ce bouton est √† utliser dans les page d'ajout et d'√©dition d'objet, en le passant comme builder d'un WaitingButton.\",\"Param√®tres :\",\"child (Widget)obligatoire : Le contenu du bouton (Ex: un Text)\",\"color (Color)obligtoire : La couleur de fond du bouton\",\"colors (Color)optionel : Si donn√©, le fond du bouton sera un gradient avec colors comme couleur.\",\"shadownColor (Color)optionel : Si donn√©e, la couleur de la shadow\",\"borderColor (Color)optionel : Si donn√©, la couleur de la bordure\",\"Exemple :delivery_ui.dart\",\"CardButton(colors: const [ AMAPColorConstants.redGradient1, AMAPColorConstants.redGradient2 ], child: child)\"]},\"393\":{\"c\":[\"Guide\"]},\"394\":{\"h\":\"CardLayout\"},\"395\":{\"h\":\"CardLayout\",\"t\":[\"Description :\",\"Cette carte permet d'uniformiser l'apparence des cartes de chaque module. La forme est fixe, mais la couleur peut changer.\",\"Utilisation :\",\"Utilisation fr√©quente (34 fois). Ce Widget est √† utliser dans les page o√π on doit afficher une carte d'un objet.\",\"Param√®tres :\",\"child (Widget)obligatoire : Le contenu du bouton (Ex: un Text)\",\"color (Color)obligtoire : La couleur de fond du bouton\",\"colors (Color)optionel : Si donn√©, le fond du bouton sera un gradient avec colors comme couleur.\",\"shadownColor (Color)optionel : Si donn√©e, la couleur de la shadow\",\"borderColor (Color)optionel : Si donn√©, la couleur de la bordure\",\"width (double)optionel : La largeur de la carte\",\"height (double)optionel : La hauteur de la carte\",\"id (String)optionel : Si pr√©cis√©, avec l'id de l'objet dont on fait la carte, et si un page accessible depuis la page o√π ce Widget existe contient √©galement un CardLayout avec le m√™me id (d'o√π l'id√©e d'utiliser l'id de l'objet), alors la carte aura une animation de transition entre les deux pages (quelque soit la forme du child des deux pages)\",\"padding (EdgeInsetsGeometry)optionel : L'espace entre la carte et son enfant\",\"margin (EdgeInsetsGeometry)optionel : L'espace entre la carte et son parent\",\"Exemple :delivery_handler.dart\",\"CardLayout( height: 160, width: 100, shadowColor: AMAPColorConstants.textDark.withOpacity(0.2), child: const Center( child: HeroIcon( HeroIcons.plus, color: AMAPColorConstants.textDark, size: 50, ), ), )\"]},\"396\":{\"c\":[\"Guide\"]},\"397\":{\"h\":\"Customs Layouts\"},\"398\":{\"h\":\"Les Layouts\",\"t\":[\"Les Layout se contruisent avec un child, donc un widget qui ne peux pas influer sur le comportement du Widget parent.\"]},\"399\":{\"c\":[\"Guide\"]},\"400\":{\"h\":\"HorizontalListView / HorizontalListView.builder\"},\"401\":{\"h\":\"HorizontalListView / HorizontalListView.builder\",\"t\":[\"Description :\",\"Ce Widget permet de faire proprement un d√©filement horizontal. Le .builder permet de contruire le widget √† partir d'une liste.\",\"Utilisation :\",\"Utilisation fr√©quente (35 fois). Ce Widget est √† utliser dans les page o√π on doit afficher une liste de carte d'objet.\",\"Param√®tres : HorizontalListView :\",\"√¨tems (List<T>)obligatoire : La liste des objets dont on veux faire l'affichage de chaque objet\",\"itemBuilder (Widget Function(BuildContext, T, int))obligatoire : Un builder pour chaque objet de la liste\",\"height (double)obligatoire : La hauteur du Widget\",\"horizontalSpace (double)optionnel : La largeur entre les bords horizontaux et le premier et le dernier objet (15 par d√©faut)\",\"length (int)optionnel : Le nombre d'objet √† afficher dans la liste\",\"firstChild (Widget)optionnel : Si pr√©cis√©, le premier √©l√©ment de la liste (typiquement un boutton ajouter) HorizontalListView.builder :\",\"children (List<Widget>)obligatoire : Les Widgets de la ligne\",\"height (double)obligatoire : La hauteur du Widget\",\"Exemple :advert/../detail_page.dart\",\"HorizontalListView.builder( height: 35, horizontalSpace: 30, items: inTagChipsList, itemBuilder: (BuildContext context, String item, int index) => TagChip(tagname: item)),\"]},\"402\":{\"c\":[\"Guide\"]},\"403\":{\"h\":\"ItemChip\"},\"404\":{\"h\":\"ItemChip\",\"t\":[\"Description :\",\"Ce Widget permet de faire proprement un chip avec une action au clic, sa couleur d√©pend de s'il est s√©l√©ctionn√©.\",\"Utilisation :\",\"Utilisation assez rare (10 fois). Ce Widget est √† utliser dans les page o√π on doit afficher une liste de cl√©e.\",\"Param√®tres :\",\"child (Widget)obligatoire : Le contenu du bouton (Ex: un Text)\",\"selected (bool)obligatoire : Si le chip est s√©l√©ctionn√©\",\"onTap (Function())optionel : L'action √† faire au clic\",\"Exemple :section_bar.dart\",\"ItemChip( onTap: () { QR.to(VoteRouter.root + VoteRouter.admin + VoteRouter.addSection); }, child: const HeroIcon( HeroIcons.plus, color: Colors.black, ), )\"]},\"405\":{\"c\":[\"Guide\"]},\"406\":{\"h\":\"Refresher\"},\"407\":{\"h\":\"Refresher\",\"t\":[\"Description :\",\"Ce Widget permet de rafra√Æchir les providers pass√© en param√®tres quand on tire la page vers le bas.\",\"Utilisation :\",\"Utilisation fr√©quente (22 fois). Ce Widget est √† utliser dans les page o√π on doit rafra√Æchir les donn√©es en tirant vers le bas.\",\"Param√®tres :\",\"child (Widget)obligatoire : Le contenu du bouton (Ex: un Text)\",\"onRefresh (Future Function())obligatoire : La fonction appel√©e quand on tire vers le bas (typiquement le chargement d'une donn√©e)\",\"Exemple :event/.../main_page.dart\",\"Refresher( onRefresh: () async { await eventListNotifier.loadConfirmedEvent(); }, child: ... )\"]},\"408\":{\"c\":[\"Guide\"]},\"409\":{\"h\":\"Custom Widgets\"},\"410\":{\"c\":[\"Guide\"]},\"411\":{\"h\":\"AdminButton\"},\"412\":{\"h\":\"AdminButton\",\"t\":[\"Description :\",\"Le visuel du bouton pour acc√©der aux pages d'admin.\",\"Utilisation :\",\"Utilisation rare (11 fois). Ce Widget est √† utliser dans la page d'o√π on peut acc√©der aux pages d'admin (g√©n√©ralement la main_page), donc une fois par module\",\"Param√®tres :\",\"onTap (VoidCallback)obligatoire: La fonction √† appeler au clic du bouton\",\"textColor (Color)optionel : La couleur du texte du bouton (par d√©faut blanc)\",\"color (Color)optionel : La couleur de fond du bouton (par d√©faut noir)\",\"colors (List<Color>)optionel : Si pr√©cis√©, le bouton aura un gradient avec les couleurs donn√©es\",\"Exemple :amap/.../main_page.dart\",\"if (isAdmin) AdminButton( onTap: () { QR.to(AmapRouter.root + AmapRouter.admin); }, colors: const [ AMAPColorConstants.greenGradient1, AMAPColorConstants.greenGradient2 ], ),\"]},\"413\":{\"c\":[\"Guide\"]},\"414\":{\"h\":\"AdminButton\"},\"415\":{\"h\":\"AlignLeftText\",\"t\":[\"Description :\",\"Aligne le texte √† gauche, tr√®s utile pour les formulaires.\",\"Utilisation :\",\"Utilisation tr√®s fr√©quente (52 fois). Il contient beaucoup de pa